INSERT INTO `junxiac1_newlab`.`conference_cpapercontent`(`id`, `paper_id`, `TI`, `TT`, `ST`, `AB`)
VALUES (1, 1, 'Flexural and Shear Strengths of Steel Fiber Reinforced Ultra- High Performance Concrete (SFR-UHPC) Prestressed Beams', '', '', ''),
  (2, 2, 'New fatigue design model for all concrete strengths', '', '', 'At the Institute of Building Materials Science, Leibniz Universit?Â¡Ã¨t Hannover, a new design model for\r\ncompressive fatigue loading was developed. This design model is mainly based on investigations\r\nconducted on two ultra-high strength concretes. It is also applicable to normal strength and high strength\r\nconcretes. This model was further integrated into the design concept of CEB-FIP Model Code 90 [1] to\r\nensure an easy practical application. In this paper, the new design model is presented and its capabilities\r\nshall be demonstrated. The effects of the changes compared to the current standard design model are\r\nalso shown. Thereby, the ensured safety level is particularly analysed. This analysis shows that the\r\nrequired safety level is maintained. Furthermore, the new model enables an economic fatigue design.'),
  (3, 3, 'A Triaxial Fatigue Failure Model for Ultra-High-Performance', '', '', ''),
  (4, 4, 'Fatigue Behaviour of plain and fibre reinforced Ultra-High', '', '', ''),
  (5, 5, 'Direct and Flexural Tension Test Methods for Determination of the Tensile Stress-Strain Response of UHPFRC', '', '', ''),
  (6, 6, 'Experimental and Analytical Analysis of the Flexural Behavior of UHPC Beams', '', '', ''),
  (7, 7, 'Characterization of the Fracture Behavior of UHPC under Flexural Loading', '', '', ''),
  (8, 8, 'Bending Behaviour and Variation of flexural Parameters of UHPFRC', '', '', ''),
  (9, 9, 'Tests on the Flexural Tensile Strength of a UHPFRC subjected to Cycling and Reversed Loading reversed loading', '', '', ''),
  (10, 10, 'Flexural Model of Doubly Reinforced Concrete Beams Using Ultra High Performance Fiber Reinforced Concrete', '', '', ''),
  (11, 11, 'Design of Reinforced UHPFRC in Flexure', '', '', ''),
  (12, 12, 'Shear Capacity of UHPC â€“ Beam Tests', '', '', ''),
  (13, 13, 'Interface Shear Capacity of Small UHPC / HPC Composite T-Beams', '', '', ''),
  (14, 14, 'Numerical Study on the Shear Behavior of Micro-Reinforced UHPC Beams', '', '', ''),
  (15, 15, 'Experimental Investigations on I-Shaped UHPC Beams with Combined Reinforcement under Shear Load', '', '', ''),
  (16, 16, 'Ultimate Shear Strength of Ultra High Performance Fibre Reinforced Concrete Beams', '', '', ''),
  (17, 17, 'Shear Behavior of pretensioned UHPC Beams - Tests and Design', '', '', ''),
  (18, 18, 'Fatigue Behaviour of Ultra High-Performance Concrete under Cyclic Stress Reversal Loading', '', '', 'Structures designed economically by taking advantage of the material properties of Ultra\r\nHigh-Performance Concrete (UHPC) feature reduced self weight. Compared to its high\r\ncompressive strength UHPC is characterised by low tensile strength. Hence structural\r\nmembers made of UHPC should be prestressed appropriately. Due to economic design\r\nalternating live load may cause cyclic stress reversal loading. For diversified application of\r\nUHPC the examination of cyclic loading in tension-compression is of considerable practical\r\nrelevance.\r\nRepresenting this kind of loading 120 single-level fatigue tests were performed on UHPC\r\nspecimens without reinforcement. This contribution presents the effect of important\r\nparameters like stress level, stress range and fibre addition on the fatigue behaviour of\r\nUHPC in classical S-N-diagrams.'),
  (19, 19, 'Multi-Axial and Fatigue Behaviour of ultra-high performance concrete (UHPC)', '', '', ''),
  (20, 20, 'Static and fatigue bending tests of UHPC', '', '', '');

