  (531, '', 'peiyin_2004', '', 104, 'TY  - JOUR\r\nT1  - Damage constitutive of concrete under uniaxial alternate tensionaâ‚¬Â¡Â°compression fatigue loading based on double bounding surfaces\r\nJO  - International Journal of Solids and Structures\r\nVL  - 41\r\nIS  - 11aâ‚¬Â¡Â°12\r\nSP  - 3151\r\nEP  - 3166\r\nPY  - 2004/6//\r\nT2  - \r\nAU  - L??, Peiyin\r\nAU  - Li, Qingbin\r\nAU  - Song, Yupu\r\nSN  - 0020-7683\r\nM3  - doi: 10.1016/j.ijsolstr.2004.01.026\r\nUR  - http://www.sciencedirect.com/science/article/pii/S0020768304000447\r\nKW  - Damage mechanics\r\nKW  - Fatigue\r\nKW  - Alternate tensionaâ‚¬Â¡Â°compression\r\nKW  - Concrete\r\nKW  - Stress reversal\r\nKW  - Bounding surface\r\nAB  - A damage constitutive model for concrete subjected to uniaxial alternate tensionaâ‚¬Â¡Â°compression fatigue loading is presented. The tension and compression loading and bounding surfaces described in strain-energy release rate are employed to construct the damage-effective tensor in the formulation of the theoretical model. The position of the loading surface in the energy release space between the initial and the bounding surfaces denotes the level of damage state. The varying size of the limit fracture surface for fatigue loading is obtained through establishing the relationship between cumulative damage and the onset of the energy release in a cycle, which simulates the degenerative process of the stiffness of concrete under cyclic loading. Fatigue stressaâ‚¬Â¡Â°strain relationship is derived for the investigated loading history. To verify this model an experimental program considering the special mode of loading is developed. Comparisons of the theoretical stressaâ‚¬Â¡Â°strain curves and fatigue lives with the experimental data indicate good agreement.\r\nER  - \r\n\r\n\r\n'),
