INSERT INTO `junxiac1_newlab`.`journal_journalcontent`(`id`, `paper_id`, `TI`, `ST`, `AB`)
VALUES (1, 1, 'On the optimal direction of short metal fibers in brittle matrix composites', 'On the optimal direction of short metal fibers in brittle matrix composites', NULL),
  (2, 2, 'Experimental Evaluation of Structural Behavior Of Precast UHPC Waffle Bridge Deck Panels And Connections', 'Experimental Evaluation of Structural Behavior Of Precast UHPC Waffle Bridge Deck Panels And Connections', NULL),
  (3, 3, 'Advances in Concrete Bridges in Iowa', 'Advances in Concrete Bridges in Iowa', NULL),
  (4, 4, 'Bond and Development of Straight Reinforcing Bars in Tension (ACI 408-03) and Commentary (ACI 408R-03)', 'Bond and Development of Straight Reinforcing Bars in Tension (ACI 408-03) and Commentary (ACI 408R-03)', NULL),
  (5, 5, 'Modelling, testing, and construction of the first Ductal canopy in the world', 'Modelling, testing, and construction of the first Ductal<sup>????Â¡Â¥??aâ‚¬???aâ‚¬???Â¨Â¦a??a??Â¨Â¦????Â¡Â¥??Â¨Â¦a??????aâ‚¬????Â¡ÃªÂ¡Ã¨????Â¡Â¥??aâ‚¬?????Â¨Â¦??Â¨Â¦aâ‚¬?????-??????Â¡Â¥??Â¨Â¦a??????aâ‚¬????o????Â¡Â¥??aâ‚¬?????Â¨Â¦??Â¨Â¦aâ‚¬?????-??????Â¡Â¥??Â¨Â¦a??????aâ‚¬?????</sup> canopy in the world', 'Two series of nine architectural shell structures ????Â¡Â¥??aâ‚¬???aâ‚¬???Â¨Â¦a??a??Â¨Â¦????Â¡Â¥??Â¨Â¦a??????aâ‚¬?????????Â¡Â¥??aâ‚¬?????Â¨Â¦??Â¨Â¦aâ‚¬??????1????Â¡Â¥????Â¨Â¦????Â¨Â¦??Â¨Â¦a??????????aâ‚¬?????????Â¡Â¥??aâ‚¬?????Â¨Â¦??Â¨Â¦aâ‚¬?????-??????Â¡Â¥??Â¨Â¦a??????aâ‚¬????Â¡ÃªÂ¡Ã¨?constructed of a 20 mm thick layer of a new ultra-high performance cement (UPHC) composite with organic fibres (Ductal<sup>????Â¡Â¥??aâ‚¬???aâ‚¬???Â¨Â¦a??a??Â¨Â¦????Â¡Â¥??Â¨Â¦a??????aâ‚¬????Â¡ÃªÂ¡Ã¨????Â¡Â¥??aâ‚¬?????Â¨Â¦??Â¨Â¦aâ‚¬?????-??????Â¡Â¥??Â¨Â¦a??????aâ‚¬????o????Â¡Â¥??aâ‚¬?????Â¨Â¦??Â¨Â¦aâ‚¬?????-??????Â¡Â¥??Â¨Â¦a??????aâ‚¬?????</sup>) ????Â¡Â¥??aâ‚¬???aâ‚¬???Â¨Â¦a??a??Â¨Â¦????Â¡Â¥??Â¨Â¦a??????aâ‚¬?????????Â¡Â¥??aâ‚¬?????Â¨Â¦??Â¨Â¦aâ‚¬??????1????Â¡Â¥????Â¨Â¦????Â¨Â¦??Â¨Â¦a??????????aâ‚¬?????????Â¡Â¥??aâ‚¬?????Â¨Â¦??Â¨Â¦aâ‚¬?????-??????Â¡Â¥??Â¨Â¦a??????aâ‚¬????Â¡ÃªÂ¡Ã¨?were proposed to form the roofs of a new station for the light rail transit system in Calgary. Each section of the roofs consists of three panels each 6 m ????Â¡Â¥??aâ‚¬???aâ‚¬???Â¨Â¦a??a??Â¨Â¦????Â¡Â¥??Â¨Â¦a??????aâ‚¬?????Â¡Ã¬????Â¡Â¥??aâ‚¬???aâ‚¬?????Â¨Â¦????Â¡Â¥????Â¨Â¦????Â¨Â¦??Â¨Â¦aâ‚¬?????-????aâ‚¬?????????Â¡Â¥??Â¨Â¦a???|??aâ‚¬?????????Â¡Â¥??aâ‚¬?????Â¨Â¦??Â¨Â¦aâ‚¬?????-??????Â¡Â¥??Â¨Â¦a??????aâ‚¬????3 4.5 m connected to provide an 18 m continuous system. The City of Calgary required testing of a full-scale prototype panel for both static and dynamic responses. Finite element analysis (FEA) was used to determine the boundary conditions to be imposed on one edge of the prototype panel during the tests to simulate the presence of the other two in the actual structure. The FEA was also used to determine the critical (independent) snow and wind loading cases. The analyses and the testing procedures for the full-scale instrumented panel are described. The panel withstood both full factored loads without damage. The methods for manufacturing and assembling the canopy and roofs are also described. (English) [ABSTRACT FROM AUTHOR]'),
  (6, 6, 'Least-squares orthogonal distances fitting of circle, sphere, elipse, hyperbola, and parabola', 'Least-squares orthogonal distances fitting of circle, sphere, elipse, hyperbola, and parabola', 'The least-squares fitting minimizes the squares sum of error-of-fit in predefined measures. By the geometric fitting, the error distances are defined with the orthogonal, or shortest, distances from the given points to the geometric feature to be fitted. For the geometric fitting of circle/sphere/ellipse/hyperbola/parabola, simple and robust nonparametric algorithms are proposed. These are based on the coordinate description of the corresponding point on the geometric feature for the given point, where the connecting line of the two points is the shortest path from the given point to the geometric feature to be fitted. 2001 Pattern Recognition Society. Published by Elsevier Science Ltd. All rights reserved.'),
  (7, 7, 'Structural Behavior of FRP Composite Bridge Deck Panels', 'Structural Behavior of FRP Composite Bridge Deck Panels', NULL),
  (8, 8, 'Dynamic Response of Three Fiber Reinforced Polymer Composite Bridges', 'Dynamic Response of Three Fiber Reinforced Polymer Composite Bridges', NULL),
  (9, 9, 'Pull-out work of steel fibers from cementitious composites: Analytical investigation', 'Pull-out work of steel fibers from cementitious composites: Analytical investigation', 'The main objective of this study is to provide a parametric evaluation of the pull-out work of smooth steel fibers embedded in cementitious matrices. The various parameters controlling the behavior of the bond stress versus slip relationship are analyzed; their effects on the entire pull-out load versus slip response and the corresponding pull-out energy up to full debonding and/or up to total pull-out are investigated. Also discussed are the effects of the fiber geometric parameters such as fiber diameter, length, and aspect ratio. Finally, a brief section addresses the relation between pull-out work and the critical strain energy release rate Gc, a fracture mechanics variable, which can be calculated if the P- curve is known.'),
  (12, 12, 'Fiber Pullout and Bond Slip. I: Analytical Study', 'Fiber Pullout and Bond Slip. I: Analytical Study', NULL),
  (13, 13, 'Fiber Pullout and Bond Slip. II: Experimental Validation', 'Fiber Pullout and Bond Slip. II: Experimental Validation', NULL),
  (14, 14, 'Proposed modifications to ACI 318-95 tension development and lap splice for high-strength concrete', 'Proposed modifications to ACI 318-95 tension development and lap splice for high-strength concrete', 'Safety concerns and a lack of test data are responsible for the current upper limit of 100 psi on the square root of the concrete compressive strength for use in calculating tension development and lap splice lengths. Based on recent research on the lap splice strength of reinforcing bars in high-strength concrete, modifications to current design criteria are formulated that will allow removal of the limit on the square root of the compressive strength, ensure adequate ductility and bond, and improve the overall safety of the tension development and lap splice criteria in ACI 318-95 for concrete with strengths above 10,000 psi. The result of the analyses used to develop the new design criteria indicate that increasing lap splice length, without providing transverse reinforcement, does not provide an adequate level of ductility in high-strength concrete members. Adequate ductility can be achieved by using a minimum splice length, as defined by ACI 318-95 for beams without transverse reinforcement, plus a minimum quantity of transverse reinforcement over the tension development/lap splice length with an area equal to 50% of the area of the bars being developed/spliced.'),
  (15, 15, 'Behavior of lap-spliced reinforcing bars embedded in high-strength concrete', 'Behavior of lap-spliced reinforcing bars embedded in high-strength concrete', 'Safety concerns and a lack of test data on the bond strength of deformed reinforcing bars embedded in high-strength concrete are reasons why the ACI 318 Building Code has imposed an arbitrary limit of 10,000 psi (69 MPa) in calculating the tension development length and the tension lap-splice length. This limitation was first introduced in the 1989 edition of ACI 318. In an attempt to evaluate the impact of this limitation and develop provisions for its removal, a two-phase investigation was carried out at the University of Nebraska-Lincoln. This paper provides a compute summary of the experimental investigations conducted in both phases of the project. Phase I of the investigation was supported by the Portland Cement Association, while Phase II was supported by the National Science Foundation. During the two phases, 70 beam specimens with tension reinforcement splices were tested. The parameters studied included: Bar size, length and deformation type of the reinforcing bars, amount of transverse reinforcement over the splice length, casting position, and concrete compressive strength. Results of the investigation are used to discuss observed differences in how reinforcing bars in tension develop in normal and high-strength concretes (HSCs), to develop hypotheses to explain these differences, and to suggest conditions for removal of the current concrete compressive strength limitation of the ACI 318 Building Code, which applies to the calculation of tension development length and tension splice length. Development of code language provisions for removal of the current limitation, is discussed elsewhere. In this paper, HSC is defined as concrete with compressive strength exceeding 10,000 psi (69 MPa).'),
  (16, 16, 'Bond performance of reinforcing bars embedded in high-strength concrete', 'Bond performance of reinforcing bars embedded in high-strength concrete', 'Because of the lack of test data, ACI-318-89 building code requirements imposed an arbitrary upper limit of 10,000 psi (69 MPa) on specified compressive strength of concrete fc prime that may be used in calculating tension development length and tension splice length. A research study was conducted to evaluate the bond performance of reinforcing bars embedded in high-strength concrete. Twelve beam splice specimens using No. 11 reinforcing bars and concrete with compressive strengths exceeding 14,000 psi (97 MPa) were tested. The effect of several variables on bond capacity in high-strength concrete is discussed and a failure hypothesis explaining the observed behavior during the experimental phase of the study is presented. Additionally, it is concluded that the current trend in ACI of making the splice length longer to compensate for having small cover and spacing may not be an effective approach. A better approach could be to provide a minimum amount of transverse reinforcement.'),
  (17, 17, 'Review paper: Bond in fibre reinforced cements and concretes', 'Review paper: Bond in fibre reinforced cements and concretes', 'Characteristics of different types of bond and thier function in cement based matrices with fibre reinforcement are discussed. The assumptions about bond in a number of existing theoretical models predicting behaviour of fibre reinforced cements are reviewed and a graphical interpretation in used to demonstrate the influences of the main characteristics of bond on the failure of the composite. A critical survey of the methods for testing of bond is carried out and is supplemented by a discussion of the information about bond between cement matrices and different types of fibres currently available. The conclusions point out clearly the need for a continued research into the bond phenomena and indicate areas in which further work is recommended.'),
  (18, 18, 'Analysis of pull-out tests on fibres embedded in brittle matrices', 'Analysis of pull-out tests on fibres embedded in brittle matrices', 'A graphical interpretation and analysis of pull-out tests is developed to indicate combined effects of factors such as the tensile strength of the fibre and the bond characteristics of the fibre-matrix interfaces on the mode of pull-out failure. In addition to the critical embedment length the significance of two other embedment lengths is shown. One is the minimum length at which a tensile failure of a reinforcing element is not preceded by debonding and the other one is the maximum embedment length at which a complete debonding occurs instantaneously. The graphical analysis is applied to a typical pull-out test result and quantitative values of the ultimate elastic shear bond and the frictional bond are obtained.'),
  (19, 19, 'Fatigue Flexural Behavior of Pre-cracked Specimens of Special UHPFRC', 'Fatigue Flexural Behavior of Pre-cracked Specimens of Special UHPFRC', NULL),
  (20, 20, 'Simplified Modified Compression Field Theory for Calculating Shear Strength of Reinforced Concrete Elements', 'Simplified Modified Compression Field Theory for Calculating Shear Strength of Reinforced Concrete Elements', 'This paper summarizes the results of over 100 pure shear tests on reinforced concrete panels. The ACI approach for predicting shear strength as the sum of a diagonal cracking load and a 45-degree truss model predicts the strength of these panels poorly, with an average experimental-over-predicted shear strength ratio of 1.40 with a coefficient of variation of 46.7%. Based on a subset of these experiments, an expressive but relatively complex analysis method called the modified compression field theory (MCFT) was developed in the 1980s that is able to predict full load deformation relationships. This theory can predict the shear strength of these panels with an average shear strength ratio of 1.01 and a coefficient of variation (COV) of only 12.2%. This paper presents a new simplified analysis method that can predict the strength of these panels in a method suitable for ????Â¡Â¥??aâ‚¬???aâ‚¬???Â¨Â¦a??a??Â¨Â¦????Â¡Â¥??Â¨Â¦a??????aâ‚¬?????Â¨Â¦????Â¡Â¥??aâ‚¬???aâ‚¬?????Â¨Â¦????Â¡Â¥????Â¨Â¦????Â¨Â¦??Â¨Â¦a??????????aâ‚¬|????????Â¡Â¥??Â¨Â¦a??????aâ‚¬?????????Â¡Â¥??aâ‚¬?????Â¨Â¦??Â¨Â¦aâ‚¬??????|????Â¡Â¥????Â¨Â¦????Â¨Â¦??Â¨Â¦a??????????aâ‚¬|??Â¨Â¦a????Â¡Ã£back of the envelope????Â¡Â¥??aâ‚¬???aâ‚¬???Â¨Â¦a??a??Â¨Â¦????Â¡Â¥??Â¨Â¦a??????aâ‚¬?????Â¨Â¦????Â¡Â¥??aâ‚¬???aâ‚¬?????Â¨Â¦????Â¡Â¥????Â¨Â¦????Â¨Â¦??Â¨Â¦a??????????aâ‚¬|????????Â¡Â¥??Â¨Â¦a??????aâ‚¬?????????Â¡Â¥??aâ‚¬?????Â¨Â¦??Â¨Â¦aâ‚¬?????-??????Â¡Â¥??Â¨Â¦a??????aâ‚¬????? calculations. This new method gives an average shear strength ratio of 1.11 with a COV of 13.0%. The application of this new simplified method to panels is demonstrated with numerical examples.'),
  (21, 21, 'Fiber orientation measurements in composite materials', 'Fiber orientation measurements in composite materials', NULL),
  (22, 22, 'Mechanical Properties and Durability of Two Industrial Reactive Powder Concretes', 'Mechanical Properties and Durability of Two Industrial Reactive Powder Concretes', NULL),
  (24, 24, 'Simplified Flexural Response of Steel Fiber-Reinforced Concrete Beams', 'Simplified Flexural Response of Steel Fiber-Reinforced Concrete Beams', NULL),
  (25, 25, 'Size effect on nominal strength of concrete structures: Multifractality of material ligaments and dimensional transition from order to disorder', 'Size effect on nominal strength of concrete structures: Multifractality of material ligaments and dimensional transition from order to disorder', NULL),
  (26, 26, 'Bond between steel and self-consolidating concrete: experiments and modeling', 'Bond between steel and self-consolidating concrete: experiments and modeling', 'An experimental investigation was performed to study the bond between deformed bars and self-consolidating concrete (SCC) through pullout tests on short cylindrical anchorages. The specimens were cast with plain and fiber-reinforced (1% of steel fibers) SCC to evaluate the confinement given by fibers. In the case of plain concrete, tests were performed with and without lateral pressure. To assess size effects, three bar diameters were considered, and the geometry of the specimens was adopted to assume a constant ratio between the specimen diameter/bar diameter (= 9) and the bonded length/bar diameter (-2). The results were analyzed by a limit analysis model to evaluate the ultimate bond capacity and concrete cover at which the splitting/pullout failure transition is observed. SCC exhibits higher bond strength and, compared to ordinary concrete, requires larger concrete cover to attain pullout failure.'),
  (27, 27, 'Effects of transition zone densification on fiber/cement paste bond strength improvement', 'Effects of transition zone densification on fiber/cement paste bond strength improvement', 'This paper investigates the effectiveness of transition zone densification on the fiber-cement paste system. By controlling the water: cement (w:c) ratio and the condensed silica fume content, environmental scanning electron microscopy studies confirm that transition zone densification can be achieved in all brass, steel, and polyethylene fiber-cement systems. However, single fiber pullout tests indicate that densification only enhances the brass-cement paste interface bond strength and not the other systems. Further microscopy investigation of the surface of fibers peeled off from a composite fracture surface and of the groove left by the fiber on the cement paste suggests that bond failure for the brass-cement system is of a cohesive type, whereas bond failure for the other two systems is of an adhesive type. It is concluded that the transition zone densification technique should be effective in fiber-cement systems in which bond strength is controlled by cohesive failure of the transition zone material.'),
  (28, 28, 'Effect of silica fume on steel fiber bond characteristics in reactive powder concrete', 'Effect of silica fume on steel fiber bond characteristics in reactive powder concrete', 'In this paper, the effect of silica fume on the bond characteristics of steel fiber in matrix of reactive powder concrete (RPC), including bond strength, pullout energy, etc., are presented. The experimental results on steel fiber pullout test of different conditions are reported. Various silica fume contents ranging from 0% to 40% are used in the mix proportions. Fiber pullout tests are conducted to measure the bond characteristics of steel fiber from RPC matrix. It is found that the incorporation of silica fume can effectively enhance the fiber-matrix interfacial properties, especially in fiber pullout energy. It is also concluded that in terms of the bond characteristics, the optimal silica fume content is between 20% and 30%, given the conditions of the experimental program. The microstructural observation confirms the findings on the interfacial-toughening mechanism drawn from the fiber pullout test results. 2004 Elsevier Ltd. All rights reserved.'),
  (29, 29, 'Processing and mechanical properties of a porous low carbon steel with a controlled porous structure by imposition of a static magnetic field', 'Processing and mechanical properties of a porous low carbon steel with a controlled porous structure by imposition of a static magnetic field', NULL),
  (30, 30, 'Unified Shear Strength Model for Reinforced Concrete Beams--??Part II: Verification and Simplified Method', 'Unified Shear Strength Model for Reinforced Concrete Beams????Â¡Â¥??aâ‚¬???aâ‚¬???Â¨Â¦a??a??Â¨Â¦????Â¡Â¥??Â¨Â¦a??????aâ‚¬?????Â¨Â¦????Â¡Â¥??aâ‚¬???aâ‚¬?????Â¨Â¦????Â¡Â¥????Â¨Â¦????Â¨Â¦??Â¨Â¦a??????????aâ‚¬|????????Â¡Â¥??Â¨Â¦a??????aâ‚¬?????????Â¡Â¥??aâ‚¬???aâ‚¬?????Â¨Â¦????Â¡Â¥????Â¨Â¦????Â¨Â¦??Â¨Â¦aâ‚¬?????-????aâ‚¬?????????Â¡Â¥??Â¨Â¦a??????aâ‚¬?????Part II: Verification and Simplified Method', ''),
  (31, 31, 'Unified Shear Strength Model for Reinforced Concrete Beams--??Part I: Development', 'Unified Shear Strength Model for Reinforced Concrete Beams????Â¡Â¥??aâ‚¬???aâ‚¬???Â¨Â¦a??a??Â¨Â¦????Â¡Â¥??Â¨Â¦a??????aâ‚¬?????Â¨Â¦????Â¡Â¥??aâ‚¬???aâ‚¬?????Â¨Â¦????Â¡Â¥????Â¨Â¦????Â¨Â¦??Â¨Â¦a??????????aâ‚¬|????????Â¡Â¥??Â¨Â¦a??????aâ‚¬?????????Â¡Â¥??aâ‚¬???aâ‚¬?????Â¨Â¦????Â¡Â¥????Â¨Â¦????Â¨Â¦??Â¨Â¦aâ‚¬?????-????aâ‚¬?????????Â¡Â¥??Â¨Â¦a??????aâ‚¬?????Part I: Development', ''),
  (32, 32, 'Pullout of Inclined Flexible Fiber in Cementitious Composite', 'Pullout of Inclined Flexible Fiber in Cementitious Composite', NULL),
  (33, 33, 'Two-Phase Composite Model for High Performance Cementitious Composites', 'Two-Phase Composite Model for High Performance Cementitious Composites', NULL),
  (34, 34, 'Mechanical properties of modified reactive powder concrete', 'Mechanical properties of modified reactive powder concrete', NULL),
  (35, 35, 'The Modified Compression-Field Theory for Reinforced Concrete Elements Subjected to Shear', 'The Modified Compression-Field Theory for Reinforced Concrete Elements Subjected to Shear', NULL),
  (36, 36, 'The effect of two types of C-S-H on the elasticity of cement-based materials: Results from nanoindentation and micromechanical modeling', 'The effect of two types of C-S-H on the elasticity of cement-based materials: Results from nanoindentation and micromechanical modeling', 'It has long been recognized, in cement chemistry, that two types of calcium-silicate-hydrate (C-S-H) exist in cement-based materials, but less is known about how the two types of C-S-H affect the mechanical properties. By means of nanoindentation tests on nondegraded and calcium leached cement paste, the paper confirms the existence of two types of C-S-H, and investigates the distinct role played by the two phases on the elastic properties of cement-based materials. It is found that (1) high-density C-S-H are mechanically less affected by calcium leaching than low density C-S-H, and (2) the volume fractions occupied by the two phases in the C-S-H matrix are not affected by calcium leaching. The nanoindentation results also provide quantitative evidence, suggesting that the elastic properties of the C-S-H phase are intrinsic material properties that do not depend on mix proportions of cement-based materials. The material properties and volume fractions are used in a novel two-step homogenization model, that predicts the macroscopic elastic properties of cement pastes with high accuracy. Combined with advanced physical chemistry models that allow, for a given w/c ratio, determination of the volume fractions of the two types of C-S-H, the model can be applied to any cement paste, with or without Portlandite, Clinker, and so on. In particular, from an application of the model to decalcified cement pastes, it is shown that that the decalcification of the C-S-H phase is the primary source of the macroscopic elastic modulus degradation, that dominates over the effect of the dissolution of Portlandite in cement-based material systems. 2003 Elsevier Ltd. All rights reserved.'),
  (37, 37, 'Fatigue Failure of Concrete in Tension', 'Fatigue Failure of Concrete in Tension', NULL),
  (38, 38, 'Pullout behavior of steel fibers in self-compacting concrete', 'Pullout behavior of steel fibers in self-compacting concrete', 'In steel fiber-reinforced composites materials, fiber and matrix are bonded together through a weak interface. The study of this interfacial behavior is important for understanding the mechanical behavior of such composites. Moreover, with the outcome of new composites materials with improved mechanical properties and advanced cement matrices, such in the case of steel fiber reinforced self-compacting concrete, the study of the fiber/matrix interface assumes a new interest. In the present work, experimental results of both straight and hooked-end steel fibers pullout tests on a self-compacting concrete medium are presented and discussed. Emphasis is given to the accurate acquirement of the pullout load versus end-slip relationship. The influence of fiber embedded length and orientation on the fiber pullout behavior is studied. Additionally, the separate assessment of the distinct bond mechanisms is performed, by isolating the adherence bond from the mechanical bond provided by the hook. Finally, analytical bond-slip relationships are obtained by back-analysis procedure with an interfacial cohesive model. 2010 ASCE.'),
  (39, 39, 'Recommended provisions and commentary on development and lap splice lengths for deformed reinforcing bars in tension', 'Recommended provisions and commentary on development and lap splice lengths for deformed reinforcing bars in tension', 'Criteria recommended by ACI Committee 408 on development and lap splice length design for straight reinforcing bars in tension are presented in code format and compared with those in ACI 318-05, Building Code Recommendations for Structural Concrete. The recommended criteria produce designs with improved reliability compared to those in ACI 318. Development lengths are longer than those in ACI 318 for conditions of low cover or confinement, but shorter for bars with higher degrees of confinement, provided by added cover and transverse reinforcement and wider spacing between bars, and for normalweight concretes with strengths between 10,000 and 16,000 psi (70 and 110 MPa). Copyright &copy; 2005, American Concrete Institute.'),
  (40, 40, 'Splice strength of high relative rib area reinforcing bars', 'Splice strength of high relative rib area reinforcing bars', 'The testing and analysis of 83 beam-splice specimens containing bars with relative rib areas ranging from 0.65 to 0.140 are described. Concretes containing two different coarse aggregates are used to evaluate the effect of aggregate properties on bond strength. Sixty specimens contain uncoated bars with confining transverse reinforcement. Thirteen specimens contain uncoated bars without confining reinforcement, and 10 specimens contain epoxy-coated bars, nine without confining reinforcement and one with confining reinforcement. The tests are analyzed to determine the effect of relative rib area and bar diameter on the increase in bond strength provided by confining reinforcement. The tests also provide a preliminary indication of the effect of high relative rib area on the splice strength of epoxy-coated bars.'),
  (41, 41, 'Development length criteria for conventional and high relative rib area reinforcing bars', 'Development length criteria for conventional and high relative rib area reinforcing bars', 'An expression for the bond force at failures is developed by conducting statistical analyses of 133 splice and development specimens in which the bars are not confined by transverse reinforcement and 166 specimens in which the bars are confined by transverse reinforcement. The expression is developed as a function of concrete strength, cover, bar spacing, development/splice length, transverse reinforcement, and the geometric properties of the developed/spliced bars. Using the results, design criteria are formulated that incorporate a reliability-based strength reduction factor that allows the calculation of a single value for both development and splice length for given material properties and member geometry.'),
  (42, 42, 'Shear response, deformations, and subgrade stiffness of a dowel bar embedded in concrete', 'Shear response, deformations, and subgrade stiffness of a dowel bar embedded in concrete', NULL),
  (43, 43, 'Dowel Action of Reinforcement Crossing Cracks in Concrete', 'Dowel Action of Reinforcement Crossing Cracks in Concrete', NULL),
  (44, 44, 'Distribution of steel fibres in rectangular sections', 'Distribution of steel fibres in rectangular sections', 'In this paper a calculation method is explained to predict the total number of fibres crossing a rectangular section. The largest part of the paper deals with the theoretical calculation of an orientation factor. The orientation factor is defined here as the average length of the projection on the longitudinal axis of all fibres crossing a section, divided by the fibre length. Once the orientation factor is found, a simple calculation gives the number of fibres crossing a crack. Since the proposed approach is to a large extent new, there is a need for verification with test results. For this reason a fibre counting was done on 107 Rilem beam specimens, involving different fibre types. The comparison with the calculated number of fibres shows that the model provides good predictions of the number of fibres crossing a section. 2004 Elsevier Ltd. All rights reserved.'),
  (45, 45, 'Use of a crack-bridging single-fiber pullout test to study steel fiber/cementitious matrix composites', 'Use of a crack-bridging single-fiber pullout test to study steel fiber/cementitious matrix composites', 'The fracture process of steel fiber/cementitious matrix composites has been studied using a single-fiber pullout test that permits detailed measurements of the load-crack opening displacement relationship during fiber debonding and unloading. Using a suitable analytical model, the interfacial fracture energy and interfacial sliding friction have been calculated for composites incorporating steel fibers with cement paste or mortar matrices. Comparison of theoretical debonding curves with the experimental data show that the model accurately represents the fiber debonding process, except for a decrease in interfacial sliding friction due to wear of matrix asperities at the interface. Differences between the calculated interfacial properties of several specimens are associated with changes in the interfacial microstructure.'),
  (46, 46, 'Moire interferometry analysis of fiber debonding', 'Moire interferometry analysis of fiber debonding', 'Progressive fiber debonding in steel fiber/cementitious matrix composites has been studied using a single fiber pullout test that permits simultaneous measurements of the load versus crack opening displacement relationship and Moire interferometry fringe patterns. Analysis of Moire interferometry patterns allows the fiber axial and interfacial shear stresses to be calculated along the entire fiber length. The interfacial shear stress distribution along the debonded length of the fiber indicates a steep decrease in shear stress with interfacial slip, from 6 to 1 MPa for 7 m of fiber slip and a crack opening displacement of 22 m. These results suggest that improvements in the toughness of cement-based composites could be achieved by developing materials in which the decrease in shear stress is less severe.'),
  (47, 47, 'Life-Cycle Costs of Fiber-Reinforced-Polymer Bridge Decks', 'Life-Cycle Costs of Fiber-Reinforced-Polymer Bridge Decks', NULL),
  (48, 48, 'Behavior of beams with dowel action', 'Behavior of beams with dowel action', NULL),
  (49, 49, 'Bond characteristics of high-strength steel reinforcement', 'Bond characteristics of high-strength steel reinforcement', 'This paper summarizes an investigation undertaken to study the bond characteristics of high-strength steel reinforcement bars commercially known as microcomposite, multistructural, formable steel (MMFX). The objective of the investigation is to examine the applicability of the ACI 318-02 equation and a current proposed equation by Zuo and Darwin on bond behavior of steel reinforcement to the concrete member. The experimental program included two phases. The first phase of the experimental program consisted of testing four beam-end specimens reinforced with MMFX steel bars, whereas the second phase included testing eight beam-splice specimens reinforced with MMFX steel bars. The selected four factors considered in this study were bar size, level of confinement, bonded length, and bar cast position. The bond behavior of the MMFX steel bars was found to be similar to that of conventional Grade 420 MPa (60 ksi) steel up to the proportional limit of 550 MPa (80 ksi). The bond strength of the MMFX significantly changes as the tensile stresses developed in the bar exceed the proportional limit. The test results indicated that both the ACI 318-02 equation and the current proposed equation by Zuo and Darwin on bond are adequate and resulted in conservative prediction at low stress levels up to 550 MPa (80 ksi). At high stress levels, however, the prediction using both equations is unconservative due to the nonlinear behavior of the MMFX stress-strain relationship. Based on the limited number of specimens considered in this study, modification to both the ACI 318-02 equation and the Zuo and Darwin equation is proposed to predict the bond forces beyond the proportional limit for MMFX steel bars. Copyright &copy; 2006, American Concrete Institute. All rights reserved.'),
  (50, 50, 'Structural Reliability of Prestressed UHPC Flexure Models for Bridge Girders', 'Structural Reliability of Prestressed UHPC Flexure Models for Bridge Girders', NULL),
  (51, 51, 'Development/splice length of reinforcing bars', 'Development/splice length of reinforcing bars', 'This paper presents an equation to calculate the required development/ splice length of reinforcing bars. The equation is based on previous studies on bond between normal-strength concrete (NSC) and high-strength concrete (HSC) and reinforcing bars. The previous proposed equation to predict the bond strength has been modified to account for the effect of rib properties of reinforcing bars. Also, a new parameter to account for the effect of transverse reinforcement (TR) on bond strength has been introduced. The comparison between the results of 284 available tests in cases of NSC and HSC shows that the new proposed model correlates very well with the test results. Using the proposed equation for bond strength, an equation to calculate the development/splice length has been derived. The equation requires providing some amounts of TR along the development/splice length. By providing the calculated value of TR, the proposed development/splice length would result in adequate ductility for beams with spliced bars. The proposed procedure correlates well with the test results. Copyright &copy; 2005, American Concrete Institute.'),
  (52, 52, 'Bond between normal strength and high-strength concrete (HSC) and reinforcing bars in splices in beams', 'Bond between normal strength and high-strength concrete (HSC) and reinforcing bars in splices in beams', 'This paper presents the second part of a study on bond. It reports on the influence of several parameters on bond in splices. The parameters covered are concrete strength, splice length, concrete cover, ratios between side cover, bottom cover, and the spacing between the spliced bars, rib face angle of the reinforcing bar, and admixtures in the concrete mix. The study was conducted in two stages. In the first stage, an analytical equation was developed to calculate the bond strength of splices in normal strength concrete. The mean value of test/calculated bond strength for the proposed equation is 1.007 with a standard deviation of 0.084. These values indicate a significant improvement in the calculation of the bond strength when compared to other proposed equations. The second stage of the research involved tests on twenty two beams made of high-strength concrete (HSC). In each beam, the tensile steel was spliced in the constant moment zone. The test strengths are compared with the calculated values. Good correlation between calculated and test strengths of splices in the case of HSC is found.'),
  (53, 53, 'Local bond strength of reinforcing bars in normal strength and high-strength concrete (HSC)', 'Local bond strength of reinforcing bars in normal strength and high-strength concrete (HSC)', 'The paper presents the first part of a study on bond. It reports the research conducted on bond strength of short length specimens (Local Bond Strength) in normal strength and high-strength concrete (HSC). For normal strength concrete, using the test results available in the literature, Tepfers\' partly cracked thick cylinder theory is modified to account for the variation of the bursting angle and the tensile plastic deformation of the concrete. The study of local bond in HSC included tests of forty-five short length specimens using two types of bars with different rib face angles. For different ranges of concrete strength, a relationship for bond strength normalized with respect to the tensile strength of concrete is obtained. The normalized bond strength increased with the compressive strength of concrete. The bond strength of the bars with rib face angles between 23 and 27 deg is smaller than that of bars with rib face angles between 40 to 47 deg.'),
  (54, 54, 'Effect of bond-slip on the crack bridging capacity of steel fibers in cement-based composites', 'Effect of bond-slip on the crack bridging capacity of steel fibers in cement-based composites', 'To increase the crack bridging capacity of concretes and mortars, fibers are often added to cement-based matrices. As a result, the fracture energy of a fiber-reinforced concrete (FRC) is the sum of the cohesive forces of the matrix and of the pullout resistance given by the fibers crossing the crack. In the case of fibers randomly inclined with respect to crack surfaces, the so-called frictional snubbing effect must be added to the previous contributions, if the energy released during crack growth has to be computed. Of course, snubbing forces are not present when fibers are perfectly orthogonal to crack surfaces. As the classical formulas are not always effective in the evaluation of snubbing phenomenon, a cohesive interface model is here proposed for a more precise definition of the frictional snubbing forces. The model is able to predict adequately the experimental results obtained by pulling out steel fibers at different inclinations angles from cement-based matrices. By analyzing fibers with different bond properties, the proposed model can be also used to define the crack bridging capacity of both bonded and unbonded steel fibers. Moreover, it seems to suggest a more simplified approach for the definition of the postcracking response of FRC. 2008 ASCE.'),
  (55, 55, 'High performance fibre-reinforced cementitious composite (CARDIFRC) - Performance and application to retrofitting', 'High performance fibre-reinforced cementitious composite (CARDIFRC) - Performance and application to retrofitting', NULL),
  (56, 56, 'High mechanical performance of fibre reinforced cementitious composites: the role of \"casting-flow induced\" fibre orientation', 'High mechanical performance of fibre reinforced cementitious composites: the role of \"casting-flow induced\" fibre orientation', NULL),
  (57, 57, 'Controlled rate thermal treatment of reactive powder concretes', 'Controlled rate thermal treatment of reactive powder concretes', NULL),
  (58, 58, 'On Behavior of High-Strength Concrete Columns: Cover Spalling, Steel Fibers, and Ductility', 'On Behavior of High-Strength Concrete Columns: Cover Spalling, Steel Fibers, and Ductility', NULL),
  (59, 59, 'The application of steel-fibres as concrete reinforcement in Australia: from material to structure', 'The application of steel-fibres as concrete reinforcement in Australia: from material to structure', NULL),
  (60, 60, 'Fatigue of concrete under uniaxial compression cyclic loading', 'Fatigue of concrete under uniaxial compression cyclic loading', NULL),
  (61, 61, 'M-f-P Diagrams for Concrete Sections Under Biaxial Flexure and Axial Compression', 'M-f-P Diagrams for Concrete Sections Under Biaxial Flexure and Axial Compression', NULL),
  (62, 62, 'Postcracking Tensile Strength of Fiber Reinforced Concrete', 'Postcracking Tensile Strength of Fiber Reinforced Concrete', 'A probabilistic model for predicting the expected value and the variance of the postcracking tensile strength of fiber reinforced concrete is presented. Fibers are assumed to occur as a spatial Poisson process. Orientation of the fibers is assumed to be of three types: 1) randomly orientated in space; 2) randomly orientated within a prescribed plane; and 3) fibers all aligned along an axis. Analytical strength predictions are compared with existing strength data and the model assumptions are critically discussed.'),
  (63, 63, 'Study of the distribution :and orientation of fibers in SFRC specimens', 'Study of the distribution :and orientation of fibers in SFRC specimens', NULL),
  (64, 64, 'COMPLETE CHARACTERISATION OF TENSILE PROPERTIES OF DUCTAL UHPFRC ACCORDING TO THE FRENCH RECOMMENDATIONS', 'COMPLETE CHARACTERISATION OF TENSILE PROPERTIES OF DUCTAL????Â¡Â¥??aâ‚¬???aâ‚¬???Â¨Â¦a??a??Â¨Â¦????Â¡Â¥????Â¨Â¦????Â¨Â¦??Â¨Â¦a??????????aâ‚¬|????????Â¡Â¥??aâ‚¬?????Â¨Â¦??Â¨Â¦aâ‚¬?????-??????Â¡Â¥??Â¨Â¦a??????aâ‚¬????? UHPFRC ACCORDING TO THE FRENCH RECOMMENDATIONS', ''),
  (65, 65, 'Analysis of the effect of embedded fibre length on fibre debonding and pull-out from an elastic matrix', 'Analysis of the effect of embedded fibre length on fibre debonding and pull-out from an elastic matrix', 'The nature and properties of the resistance to fibre-matrix interfacial debonding in composites composed of ductile fibres in a brittle or elastic matrix can be determined using the single-fibre pull-out test. The results of such tests on cementitious matrix specimens indicate a non-linear relationship between the debonding and/or pull-out load and the embedded length of the fibre. Several of the theories developed to explain the debonding process and enable estimation of the parameters representing the debonding resistance through an analysis of pull-out test results are reviewed in this first of a two-part paper. The application of these theories to experimental data for steel fibre-cementitious matrix pull-out specimens is examined in the second part.'),
  (67, 67, 'Flexural Behavior of an Ultrahigh-Performance Concrete I-Girder', 'Flexural Behavior of an Ultrahigh-Performance Concrete I-Girder', NULL),
  (68, 68, 'Durability of an Ultrahigh-Performance Concrete', 'Durability of an Ultrahigh-Performance Concrete', 'Significant recent advancements in cement-based, fiber-reinforced composite materials have stretched the bounds of concrete into the realm of ultrahigh-performance concrete (UHPC). The durability of a commercially available UHPC was independently evaluated through six standardized durability tests and the results are reported herein. Regardless of the curing treatment applied, this concrete exhibits significantly enhanced durability properties as compared to normal and high performance concretes. The concrete exhibited minimal damage after being subjected to two times the normal number of ASTM C 666 freeze????Â¡Â¥??aâ‚¬???aâ‚¬???Â¨Â¦a??a??Â¨Â¦????Â¡Â¥??Â¨Â¦a??????aâ‚¬?????????Â¡Â¥??aâ‚¬?????Â¨Â¦??Â¨Â¦aâ‚¬??????1????Â¡Â¥????Â¨Â¦????Â¨Â¦??Â¨Â¦a??????????aâ‚¬?????????Â¡Â¥??aâ‚¬?????Â¨Â¦??Â¨Â¦aâ‚¬?????-??????Â¡Â¥??Â¨Â¦a??????aâ‚¬????Â¡ÃªÂ¡Ã¨????Â¡Â¥??aâ‚¬???aâ‚¬???Â¨Â¦a??a??Â¨Â¦????Â¡Â¥??Â¨Â¦a??????aâ‚¬????|????Â¡Â¥??aâ‚¬?????Â¨Â¦??Â¨Â¦aâ‚¬?????-??????Â¡Â¥??Â¨Â¦a??????aâ‚¬?????????Â¡Â¥??aâ‚¬???aâ‚¬?????Â¨Â¦????Â¡Â¥????Â¨Â¦????Â¨Â¦??Â¨Â¦aâ‚¬?????-????aâ‚¬?????????Â¡Â¥??Â¨Â¦a??????aâ‚¬?????Â¨Â¦haw cycles. It was innocuous to ASTM C 1260 ASR deterioration, to ASTM C 672 scaling deterioration, and to AASHTO T259 chloride penetration. The ASTM C 1202 Electrical Indication of Concrete????Â¡Â¥??aâ‚¬???aâ‚¬???Â¨Â¦a??a??Â¨Â¦????Â¡Â¥??Â¨Â¦a??????aâ‚¬?????????Â¡Â¥??aâ‚¬?????Â¨Â¦??Â¨Â¦aâ‚¬??????1????Â¡Â¥????Â¨Â¦????Â¨Â¦??Â¨Â¦a??????????aâ‚¬?????????Â¡Â¥??aâ‚¬?????Â¨Â¦??Â¨Â¦aâ‚¬?????-??????Â¡Â¥??Â¨Â¦a??????aâ‚¬????Â¡ÃªÂ¡Ã¨????Â¡Â¥??aâ‚¬???aâ‚¬???Â¨Â¦a??a??Â¨Â¦????Â¡Â¥??Â¨Â¦a??????aâ‚¬????|????Â¡Â¥??aâ‚¬?????Â¨Â¦??Â¨Â¦aâ‚¬?????-??????Â¡Â¥??Â¨Â¦a??????aâ‚¬????a????Â¡Â¥??aâ‚¬?????Â¨Â¦??Â¨Â¦aâ‚¬??????|????Â¡Â¥??Â¨Â¦a??????aâ‚¬????? Ability to Resist Chloride Ion Penetration test result was negligible if any steam-based curing treatment was applied, and was very low otherwise. Steam-based curing treatments significantly enhanced the ASTM C 944 abrasion resistance. The curing treatment applied to this concrete can affect the durability properties, partly due to steam treatment increasing the degree of hydration of the concrete, improving its microstructure, and decreasing its permeability. [ABSTRACT FROM AUTHOR]'),
  (69, 69, 'Compressive Behavior of Ultra-High-Performance Fiber-Reinforced Concrete', 'Compressive Behavior of Ultra-High-Performance Fiber-Reinforced Concrete', NULL),
  (71, 71, 'Deployment of Ultra -High-Performance Concrete Technology', 'Deployment of Ultra -High-Performance Concrete Technology', NULL),
  (72, 72, 'Cement based electromagnetic shielding and absorbing building materials', 'Cement based electromagnetic shielding and absorbing building materials', 'With more and more severity of electromagnetic environment pollution, the study on building materials that can prevent electromagnetic interference (EMI) has caused great attention. This paper mainly reviews the progress and prospective future of cement-based EMI shielding and wave absorbing building materials.'),
  (73, 73, 'Effect of mortar fineness and adhesive agents on pullout response of steel fibers', 'Effect of mortar fineness and adhesive agents on pullout response of steel fibers', 'The influence of mortar fineness and several adhesive additives on the pullout load-versus-slip response of steel fibers is described. Ten different mortar mixtures were prepared. Parameters included two types of sand and four types of additives that were expected to influence the interfacial zone between the fiber and the matrix. The fibers were either smooth round, hooked round, or triangular twisted. All mixtures had the same sand-cement ratio and water-cementitious ratio. The two sands were Ottawa silica sands, one identified as normal sand 50 to 70 (that is, passing ASTM sieve 50 and retained on sieve 70, with an average particle size of 270 microns), and the other identified as microsand 270 (with an average particle size of approximately 14 microns). The four additives were fly ash (as a cement replacement), metakaolin, latex, and polyvinyl alcohol (PVA). Control mixtures without any additive were also tested. The specimens prepared were half dogbone-shaped specimens with a single embedded fiber. At least four specimens were prepared and tested for each parameter. Pullout load versus global slip curves were recorded, and an average curve was generated for comparison purposes. Conclusions are drawn related to the influence of test parameters on the pullout load versus slip response; frictional, adhesive, or mechanical bond; and pullout energy.'),
  (74, 74, 'The elasticity and strength of paper and other fibrous materials', 'The elasticity and strength of paper and other fibrous materials', NULL),
  (75, 75, 'Time dependent behavior of elements combining ultra-high performance fiber reinforced concretes (UHPFRC) and reinforced concrete', 'Time dependent behavior of elements combining ultra-high performance fiber reinforced concretes (UHPFRC) and reinforced concrete', 'Abstract&nbsp;&nbsp;Structural elements combining Ultra-High Performance Fiber Reinforced Concretes (UHPFRC) and concrete offer a high potential in view of rehabilitation and modification of existing structures. The investigation of the time-dependent behavior of composite ????Â¡Â¥??aâ‚¬???aâ‚¬???Â¨Â¦a??a??Â¨Â¦????Â¡Â¥??Â¨Â¦a??????aâ‚¬?????Â¨Â¦????Â¡Â¥??aâ‚¬???aâ‚¬?????Â¨Â¦????Â¡Â¥????Â¨Â¦????Â¨Â¦??Â¨Â¦a??????????aâ‚¬|????????Â¡Â¥??Â¨Â¦a??????aâ‚¬?????????Â¡Â¥??aâ‚¬?????Â¨Â¦??Â¨Â¦aâ‚¬??????|????Â¡Â¥????Â¨Â¦????Â¨Â¦??Â¨Â¦a??????????aâ‚¬|??Â¨Â¦a????Â¡Ã£UHPFRC-concrete????Â¡Â¥??aâ‚¬???aâ‚¬???Â¨Â¦a??a??Â¨Â¦????Â¡Â¥??Â¨Â¦a??????aâ‚¬?????Â¨Â¦????Â¡Â¥??aâ‚¬???aâ‚¬?????Â¨Â¦????Â¡Â¥????Â¨Â¦????Â¨Â¦??Â¨Â¦a??????????aâ‚¬|????????Â¡Â¥??Â¨Â¦a??????aâ‚¬?????????Â¡Â¥??aâ‚¬?????Â¨Â¦??Â¨Â¦aâ‚¬?????-??????Â¡Â¥??Â¨Â¦a??????aâ‚¬????? elements is a fundamental step in the determination of durability and serviceability. For this, an experimental program was conducted on large composite ????Â¡Â¥??aâ‚¬???aâ‚¬???Â¨Â¦a??a??Â¨Â¦????Â¡Â¥??Â¨Â¦a??????aâ‚¬?????Â¨Â¦????Â¡Â¥??aâ‚¬???aâ‚¬?????Â¨Â¦????Â¡Â¥????Â¨Â¦????Â¨Â¦??Â¨Â¦a??????????aâ‚¬|????????Â¡Â¥??Â¨Â¦a??????aâ‚¬?????????Â¡Â¥??aâ‚¬?????Â¨Â¦??Â¨Â¦aâ‚¬??????|????Â¡Â¥????Â¨Â¦????Â¨Â¦??Â¨Â¦a??????????aâ‚¬|??Â¨Â¦a????Â¡Ã£UHPFRC-concrete????Â¡Â¥??aâ‚¬???aâ‚¬???Â¨Â¦a??a??Â¨Â¦????Â¡Â¥??Â¨Â¦a??????aâ‚¬?????Â¨Â¦????Â¡Â¥??aâ‚¬???aâ‚¬?????Â¨Â¦????Â¡Â¥????Â¨Â¦????Â¨Â¦??Â¨Â¦a??????????aâ‚¬|????????Â¡Â¥??Â¨Â¦a??????aâ‚¬?????????Â¡Â¥??aâ‚¬?????Â¨Â¦??Â¨Â¦aâ‚¬?????-??????Â¡Â¥??Â¨Â¦a??????aâ‚¬????? beams and a numerical model was validated with the test results. The experimental results and a parametric study performed with the numerical model showed that UHPFRC and normal strength reinforced concrete are compatible in the long-term and that the critical period of composite ????Â¡Â¥??aâ‚¬???aâ‚¬???Â¨Â¦a??a??Â¨Â¦????Â¡Â¥??Â¨Â¦a??????aâ‚¬?????Â¨Â¦????Â¡Â¥??aâ‚¬???aâ‚¬?????Â¨Â¦????Â¡Â¥????Â¨Â¦????Â¨Â¦??Â¨Â¦a??????????aâ‚¬|????????Â¡Â¥??Â¨Â¦a??????aâ‚¬?????????Â¡Â¥??aâ‚¬?????Â¨Â¦??Â¨Â¦aâ‚¬??????|????Â¡Â¥????Â¨Â¦????Â¨Â¦??Â¨Â¦a??????????aâ‚¬|??Â¨Â¦a????Â¡Ã£UHPFRC-concrete????Â¡Â¥??aâ‚¬???aâ‚¬???Â¨Â¦a??a??Â¨Â¦????Â¡Â¥??Â¨Â¦a??????aâ‚¬?????Â¨Â¦????Â¡Â¥??aâ‚¬???aâ‚¬?????Â¨Â¦????Â¡Â¥????Â¨Â¦????Â¨Â¦??Â¨Â¦a??????????aâ‚¬|????????Â¡Â¥??Â¨Â¦a??????aâ‚¬?????????Â¡Â¥??aâ‚¬?????Â¨Â¦??Â¨Â¦aâ‚¬?????-??????Â¡Â¥??Â¨Â¦a??????aâ‚¬????? elements are the first 90 days after the casting of the UHPFRC layer. Thus, the high potential of such composite elements can be exploited also in the long term.'),
  (76, 76, 'Experimental Investigation of Composite Ultra-High-Performance Fiber-Reinforced Concrete and Conventional Concrete Members', 'Experimental Investigation of Composite Ultra-High-Performance Fiber-Reinforced Concrete and Conventional Concrete Members', NULL),
  (78, 78, 'Development of the mechanical properties of an Ultra-High Performance Fiber Reinforced Concrete (UHPFRC)', 'Development of the mechanical properties of an Ultra-High Performance Fiber Reinforced Concrete (UHPFRC)', 'Knowledge of the mechanical properties, i.e. strength, stiffness and deformation capacity, of cementitious materials at any arbitrary time is fundamental for operations such as removal of formwork, prestressing or cracking control. This paper presents a study of the evolution of indexes related to hydration and their correlation to the development of the mechanical properties for an Ultra-High Performance Fiber Reinforced Concrete (UHPFRC). The hydration kinetics was determined using semi-adiabatic heat of hydration tests, and the mechanical properties were investigated experimentally at several ages between 3 and 365days and then described with models originally developed for conventional concretes. Models and experiments were in good agreement. Furthermore, it was observed that for the UHPFRC, the rate of development of mechanical properties was highest for the secant modulus, followed by the compressive and then the tensile strength. 2006 Elsevier Ltd. All rights reserved.'),
  (79, 79, 'Effect of fiber reinforcement on bond strength of tension lap splices in high-strength concrete', 'Effect of fiber reinforcement on bond strength of tension lap splices in high-strength concrete', 'The primary objective of the research reported in this paper was to evaluate the effect of steel fiber reinforcement on the bond strength and ductility of the mode of bond failure of tension lap splices anchored in high-strength concrete (HSC) test specimens. What makes this study significant is that ACI Committee 408 (Bond and Development) is working on proposing recommendations specifying minimum transverse reinforcement on anchored reinforcement in HSC (f prime c &gt; 70 MPa) to provide ductility to the mode of failure. To meet the objective, 12 full-scale HSC beam specimens were tested. Each beam was designed with bars spliced in a constant moment region at midspan. The variables were bar size db = 20, 25, or 32 mm, and the volume fraction of steel fibers added in the splice region Vf = 0.5, 1.0, or 2.0%. Test results indicated that the use of steel fibers in the splice region increased the bond strength and the ductility of the mode of failure of the beam specimens. The increase in bond strength with high fiber content exceeded 3 root f prime c, the maximum increase in bond strength of a reinforced concrete beam that could be achieved by using transverse reinforcement in the splice region.'),
  (80, 80, 'Correlation between roles of transverse reinforcement and steel fibers in confining tension lap splices in high-strength concrete', 'Correlation between roles of transverse reinforcement and steel fibers in confining tension lap splices in high-strength concrete', 'Two research programs were recently conducted to assess the effect of confinement provided for tension lap splices anchored in high-strength concrete (HSC) beam specimens on bond strength of the splices and mode of failure of the beams. In each program, 12 full-scale beams were tested and three bar sizes were checked (20, 25, and 32 mm). Beams of the same bar size in the two programs were identical except for the type of confinement used in the splice region. In one program, steel fibers of different volume fractions were used. In the second program, transverse reinforcement was placed in various amounts. Test results of both programs indicated positive effects of the provided confinement on the bond strength of the tension lap splices and on the mode of failure. The objective of the paper was to use the results of the two programs to perform a correlation between the amount of transverse reinforcement placed in the splice region and the volume fraction of fiber reinforcement added in the splice region during the casting procedure needed to improve the bond capacity and the ductility of the mode of failure of tension lap splices embedded in high-strength concrete.'),
  (81, 81, 'Comparison of roles of FRP sheets, stirrups, and steel fibers in confining bond critical regions', 'Comparison of roles of FRP sheets, stirrups, and steel fibers in confining bond critical regions', 'Based on experimental data of tension lap splices confined with fiber reinforced polymer (FRP) sheets in normal and high strength concrete (HSC) specimens, a new FRP confinement parameter, Ktr,f was recommended. It accounts for the increase in bond strength due to the presence of FRP sheets. In this paper, a correlation is presented between the confining effects of FRP flexible sheets, transverse reinforcement, and steel fibers to improve the bond capacity and ductility of the mode of failure of tension lap splices. The correlation is based on research programs conducted at the American University of Beirut in recent years using identical specimens except for the confinement method used: FRP sheets, transverse steel stirrups, or steel fibers. Other variables included the amount of confinement provided and concrete strength. Analysis of test results indicated that an equivalent improvement in bond strength of tension lap splices in normal and high strength concrete specimens is provided by an amount of FRP sheets corresponding to a Ktr,j value of 2.5, or an amount of transverse reinforcement corresponding to K tr of 1.0db. For HSC specimens, an amount of steel fibers corresponding to a volume fraction of 1% would provide an equivalent improvement in bond strength. &copy; ASCE.'),
  (82, 82, 'Experimental and analytical evaluation of bond strength of reinforcement in fiber-reinforced polymer-wrapped high-strength concrete beams', 'Experimental and analytical evaluation of bond strength of reinforcement in fiber-reinforced polymer-wrapped high-strength concrete beams', 'This paper presents the results of two phases of a research program conducted at the American University of Beirut (AUB) to examine the effect of confinement provided by fiber-reinforced polymer (FRP) sheets on the bond strength of tension lap splices anchored in high-strength concrete (HSC) beams. Ten beams with a nominal concrete strength of 68.95 MPa (10 ksi) were tested in positive bending. Each beam was reinforced on the tension side with three 20 mm (No. 6) bars spliced at midspan in a constant moment region. U-shaped FRP sheets were used to externally confine the splice region. The main test variables were the types of FRP sheets: glass or carbon (GFRP or CFRP), the FRP configuration in the splice region (one strip, two strips, or a continuous strip), and the number of FRP layers confining the splice region (one layer or two layers). Except for the epoxy adhesive, no additional anchorage mechanism or bonding procedure was applied for the FRP sheets on the concrete beam. Test results indicated that GFRP and CFRP wraps were effective in improving the bond strength of the lap splices and the ductility of the mode of failure. The experimental results were used to propose a new FRP confinement parameter k tr,f that accounts for the presence of FRP sheets confining tension lap splices in HSC beams. This parameter was calculated based on: area, spacing and ultimate strength of the FRP sheets, and the number and diameter of steel bars being developed. Copyright &copy; 2004, American Concrete Institute. All rights reserved.'),
  (83, 83, 'Simulation of Highly Ductile Fiber-Reinforced Cement-Based Composite Components Under Cyclic Loading', 'Simulation of Highly Ductile Fiber-Reinforced Cement-Based Composite Components Under Cyclic Loading', 'Ductile fiber-reinforced cement-based composites (DFRCCs) are being investigated for new design as well as retrofitting of structures in seismic regions. DFRCC is highly ductile and is characterized by strain-hardening in tension to strains over 3% and by unique cyclic loading behavior. To accurately predict the structural performance of DFRCC components under cyclic and seismic loading, a robust constitutive model is needed for structural-scale simulations. In this paper, a constitutive model based on total strain is proposed and applied to simulate structural component tests. The model in particular captures DFRCC????Â¡Â¥??aâ‚¬???aâ‚¬???Â¨Â¦a??a??Â¨Â¦????Â¡Â¥??Â¨Â¦a??????aâ‚¬?????Â¨Â¦????Â¡Â¥??aâ‚¬???aâ‚¬?????Â¨Â¦????Â¡Â¥????Â¨Â¦????Â¨Â¦??Â¨Â¦a??????????aâ‚¬|????????Â¡Â¥??Â¨Â¦a??????aâ‚¬?????????Â¡Â¥??aâ‚¬???aâ‚¬?????Â¨Â¦????Â¡Â¥????Â¨Â¦????Â¨Â¦??Â¨Â¦a??????????aâ‚¬|????????Â¡Â¥??Â¨Â¦a??????aâ‚¬?????Â¨Â¦s unique reversed cyclic loading behavior. The simulation results show that the implemented model is robust and reasonably accurate in simulating DFRCC structural components reinforced with steel and fiber-reinforced polymer bars.'),
  (84, 84, 'Evaluation of bond strength of steel reinforcing bars in plain and fiber-reinforced concrete', 'Evaluation of bond strength of steel reinforcing bars in plain and fiber-reinforced concrete', 'This paper presents the results of an analytical study undertaken to evaluate the bond strength of reinforcing bars embedded in plain and fiber-reinforced concrete (FRC). The analysis was conducted using a numerical solution scheme of the bond problem in which an experimentally derived local bond stress-slip response of reinforcing bars, applicable for pullout and splitting-type bond failure, was incorporated. The analytical model accurately reproduced experimental results of bond strength for reinforcing bars embedded in plain unconfined concrete with different ratios of concrete cover-to-bar diameter c/db, and having development/splice lengths of up to 60db. Also, the analytical predictions showed excellent agreement with limited experimental data of bond strength of reinforcing bars embedded in steel FRC. For plain unconfined concrete, normalization of bond strength relative to f prime c1/4, covering both NSC and HSC, leads to a more accurate prediction of experimental data and a more consistent trend in the bond results as compared to f prime c1/2. The use of fiber reinforcement significantly increases the development/splice strength and considerably enhances the ductility of bond failure. The increase in bond strength acquired using steel fibers may reach levels substantially larger than the maximum limit stipulated in the ACI building code for ordinary transverse reinforcement. Based on the results of the analysis, supported with experimental data, a design equation is proposed to evaluate the development/splice strength of reinforcing bars embedded in steel FRC.'),
  (85, 85, 'Evaluating Four-Point Bend Fatigue of Asphalt Mix Using Image Analysis', 'Evaluating Four-Point Bend Fatigue of Asphalt Mix Using Image Analysis', NULL),
  (86, 86, 'Modeling dowel action of reinforcement bars for finite element analysis of concrete structures', 'Modeling dowel action of reinforcement bars for finite element analysis of concrete structures', 'A numerical model for the dowel action of reinforcement bars crossing cracks in concrete is developed for finite element analysis of concrete structures. The beam on elastic foundation theory is used to derive the dowel force-displacement relationship, which is expressed in a smeared form in terms of dowel stress and strain in order to be compatible with the smeared crack and smeared reinforcement models commonly used in finite element analysis. This dowel action model is incorporated in a finite element program that employs secant stiffness formulation and a displacement controlled iteration scheme for nonlinear analysis. Using the finite element program, the nonlinear behaviors of several reinforced concrete beams tested by others are analyzed well into the post-peak range. The beams are analyzed first with the dowel action neglected and then again with the dowel action incorporated. It is found that in certain cases, the dowel action can have significant effects on the shear strength and ductility of reinforced concrete beams and that the analytical results generally agree better with the experimental values when the dowel action is taken into account.'),
  (87, 87, 'Entwicklung und dauerhaftigkeit ultrahochfester betone', 'Entwicklung und dauerhaftigkeit ultrahochfester betone', 'The systematic development of ultra high performance concretes (UHPC) is presented and the durability and the performance of these concretes when exposed to long-term aggressive action, is examined. The first step for the development of UHPC consists of selecting a suitable fine aggregate mix by optimizing the particle size distribution in the fine aggregate mix range with regard to the water demand. The subsequent optimization of the mortar comprises of the assessment of the mortar in a hardened state, apart from testing the fresh mortar with the aid of rheometric measurements. In the final development step, the concrete is optimized on the basis off the resulting fresh and hardened concrete properties. The interaction between cement and superplasticizer greatly influences the rheological behavior of fresh mortars. UHPC are distinguished by their extraordinary high strength and high density of the cement paste matrix that counteracts the action of aggregate media.'),
  (88, 88, 'Construction, Inspection, and Maintenance of FRP Deck Panels', 'Construction, Inspection, and Maintenance of FRP Deck Panels', NULL),
  (89, 89, 'Mechanism of fatigue crack growth in concrete', 'Mechanism of fatigue crack growth in concrete', 'Through recent studies on the fracture mechanics of concrete, the existence of a fracture process zone has been indentified, and governing mechanisms are clarified. Although analytical prediction of crack growth phenomena under static, mode I loading has been made possible, the mechanism of fatigue crack growth under cyclic loading has not been studied. In the present study an analytical model of fatigue crack growth in concrete is proposed in order to identify its governing mechanism. Consideration is based on the tension-softening behaviour of concrete under cyclic load. Low-cycle fatigue crack growth tests have been carried out in which the distribution of crack opening displacement was measured by the laser speckle method. Experimental results are compared with analytical predictions by the proposed model in order to discuss the mechanism of fatigue crack growth.'),
  (90, 90, 'Behavior of open steel grid decks for bridges', 'Behavior of open steel grid decks for bridges', NULL),
  (91, 91, 'Sandwich Panel Performance Optimizing with 3D Fiber Reinforcing Core Architecture.', 'Sandwich Panel Performance Optimizing with 3D Fiber Reinforcing Core Architecture.', NULL),
  (92, 92, 'The effect of processing on the bond and interfaces in steel fiber reinforced cement composites', 'The effect of processing on the bond and interfaces in steel fiber reinforced cement composites', 'The object of the present work was to study the influences that processing may have on the pullout resistance of a steel fiber from a normal cementitious matrix, consisting of portland cement binder cast as paste or mortars with varying sand content. In order to determine the mechanisms by which the processing affects the pull-out resistance, the nature of the interfacial transition zone (ITZ) was evaluated simultaneously by microhardness testing and characterization of its microstructure by SEM. It was found that processing of the matrix and modifications in its composition by changing the sand content had a considerable influence on the steel fiber-matrix average bond, which was increased by a factor of two. The influences are due to changes in the interfacial microstructure and the content of sand. In pastes, the interfacial microstructure seems to be the dominant mechanism controlling bond, and processing which leads to densening results in higher average bond. The influences in mortars are more complex; average bond is less sensitive to processing and is more influenced by the sand content.'),
  (93, 93, 'Shear domain of fibre-reinforced high-strength concrete beams', 'Shear domain of fibre-reinforced high-strength concrete beams', NULL),
  (94, 94, 'Size effect in bearing strength of concrete cubes', 'Size effect in bearing strength of concrete cubes', NULL),
  (95, 95, 'Size-dependent response of dowel action in R.C. members', 'Size-dependent response of dowel action in R.C. members', NULL),
  (96, 96, 'Prediction of Shear Strength of Reinforced Concrete Beams without Web Reinforcement', 'Prediction of Shear Strength of Reinforced Concrete Beams without Web Reinforcement', NULL),
  (97, 97, 'A multi-technique investigation of the nanoporosity of cement paste', 'A multi-technique investigation of the nanoporosity of cement paste', 'The nanometer-scale structure of cement paste, which is dominated by the colloidal-scale porosity within the C-S-H gel phase, has a controlling effect on concrete properties but is difficult to study due to its delicate structure and lack of long-range order. Here we present results from three experimental techniques that are particularly suited to analyzing disordered nanoporous materials: small-angle neutron scattering (SANS), weight and length changes during equilibrium drying, and nanoindentation. Particular attention is paid to differences between pastes of different ages and cured at different temperatures. The SANS and equilibrium drying results indicate that hydration of cement paste at 20 &deg;C forms a low-density (LD) C-S-H gel structure with a range of gel pore sizes and a relatively low packing fraction of solid particles. This fine structure may persist indefinitely under saturated conditions. However, if the paste is dried or is cured at elevated temperatures (60 &deg;C or greater) the structure collapses toward a denser (less porous) and more stable configuration with fewer large gel pores, resulting in a greater amount of capillary porosity. Nanoindentation measurements of pastes cured at different temperatures demonstrate in all cases the existence of two C-S-H structures with different characteristic values of the indentation modulus. The average value of the modulus of the LD C-S-H is the same for all pastes tested to date, and a micromechanical analysis indicates that this value corresponds to the denser and more stable configuration of LD C-S-H. The experimental results presented here are interpreted in terms of a previously proposed quantitative \"colloid\" model of C-S-H gel, resulting in an improved understanding of the microstructural changes associated with drying and heat curing. &copy; 2006 Elsevier Ltd. All rights reserved.'),
  (98, 98, 'Normal section bearing capacity of UHPC beam', 'Normal section bearing capacity of UHPC beam', NULL),
  (99, 99, 'Mesomechanism of steel fiber reinforcement and toughening of reactive powder concrete', 'Mesomechanism of steel fiber reinforcement and toughening of reactive powder concrete', 'Reactive powder concrete (RPC) is a novel cement-based composite material with ultra-high strength. Embedding a certain amount of short steel fibers in the matrix can improve the RPC\'s toughness and overcome the disadvantage of high brittleness. In this paper, a number of direct uniaxial tension tests have been carried out with \'8-shape\' RPC200 specimens. The bond-slip process, mesoscopic structural variation and mechanical characteristics of a fiber pullout of the matrix have been investigated using the real-time SEM loading system and CCD observation techniques. The influence of the volume of embedded short steel fibers in matrix on the mesoscopic morphology of attachments on the surface of a pulled individual fiber, the initial cracking force, the ultimate pullout force, interfacial bond strength and the pullout rupture energy have been analyzed. A general formulation relating these quantities to the volume of fibers in matrix has been proposed. The components comprising the interfacial bond strength have been outlined. In addition, the contribution that fibers make to enhance and toughen the reactive powder concrete has been discussed. It is shown that there exists an optimal threshold of fiber volume v, opt = 1.5% at which the bond performance of a fiber pullout of RPC behaves best. 2007 Science in China Press.'),
  (100, 100, 'Live Load Distribution for Steel Girder Bridges', 'Live Load Distribution for Steel Girder Bridges', NULL),
  (101, 101, 'Multiscale framework for modeling of fracture in high performance fiber reinforced cementitious composites', 'Multiscale framework for modeling of fracture in high performance fiber reinforced cementitious composites', 'A sequential multiscale approach is applied to model fracture in high performance fiber reinforced cementitious composites. For each relevant length scale, dominant substructures and associated physical mechanisms of deformation are identified and appropriate analytical/numerical model is formulated. Attention is paid to ensuring proper interconnections between these models. Validation through reproduction of experimental results proves viability of the multiscale approach. 2006 Elsevier Ltd. All rights reserved.'),
  (102, 102, 'Basic facts concerning shear failure', 'Basic facts concerning shear failure', NULL),
  (103, 103, 'An Asbestos Fiber Detection Technique Utilizing Image Processing Based on Dispersion Color', 'An Asbestos Fiber Detection Technique Utilizing Image Processing Based on Dispersion Color', 'In an asbestos qualitative analysis, the major methods are X-ray diffraction analysis and visual observation by operators using a microscope. In particular, a major method of visual evaluation is dispersion staining. In the usual visual observation process, the operators check the asbestos fibers in the view of the microscope and count the number of asbestos fibers. The method presented here attempts to detect asbestos fibers in the images taken by a microscope. The dispersion staining method identifies asbestos fibers with color dispersion from an immersion liquid combined with polarization. The presented method employs color changes of asbestos fibers associated with polarization. Specifically, candidate asbestos fibers are identified using the changes of dispersion colors and also position-matching between two images. The performance of the method has been evaluated by comparing its results with the results obtained by a human expert.'),
  (104, 104, 'Loading rate effect on pullout behavior of deformed steel fibers', 'Loading rate effect on pullout behavior of deformed steel fibers', 'This paper describes the results of single-fiber pullout tests under various loading rates ranging from the static to the seismic level. Investigation of the loading rate effect on single-fiber pullout behavior provides a basis to better understand the effect of strain rate on the tensile properties of fiber-reinforced cement composites. Two types of high-strength deformed steel fibers (hooked and twisted fibers) known to have slip-hardening behavior under static pullout loading are evaluated. Experimental results reveal that the pullout response of twisted steel fibers shows rate sensitivity that is dependent on the compressive strength of the matrix. On the other hand, high-strength hooked fibers did not show rate sensitivity under pullout for the various matrixes tested. The test results also showed the pullout energy of twisted fibers increases with the matrix compressive strength and can be up to five times that of hooked fibers. Copyright 2008, American Concrete Institute. All rights reserved.'),
  (106, 106, 'Crack propagation in flexural fatigue of concrete', 'Crack propagation in flexural fatigue of concrete', 'In this paper the behavior of concrete subjected to flexural fatigue loading is studied. Notched concrete beams were tested in a three-point bending configuration. Specimens were subjected to quasi-static cyclic and constant amplitude fatigue loading. The cyclic tests were performed by unloading the specimen at different points in the postpeak part of the quasi-static loading response. Low cycle, high amplitude fatigue tests were performed to failure using four different load ranges. The crack mouth opening displacement was continuously monitored throughout the loading process. Crack propagation caused by quasi-static and fatigue loads is described in terms of fracture mechanics. It is shown that the crack propagation in the postpeak part of the quasi-static load response is predicted using the critical value of the mode I stress intensity factor (KIC). The ultimate deformation of the specimen during the fatigue test is compared with that from the quasi-static test; it is demonstrated that the quasi-static deformation is insufficient as a fatigue failure criterion. It is observed that crack growth owing to constant-amplitude fatigue loading comprises two phases: a deceleration stage when there is a decrease in crack growth rate with increasing crack length, followed by an acceleration stage where the rate of crack growth increases at a steady rate. The crack length where the rate of crack growth changes from deceleration to acceleration is shown to be equal to the crack length at the peak load of the quasi-static response. Analytical expressions for crack growth in the deceleration and acceleration stages are developed, wherein the expressions for crack growth rate in the deceleration stage are developed using the R-curve concept, and the acceleration stage is shown to follow the Paris law. It is observed that the crack length at failure for constant amplitude fatigue loading is comparable to that of the corresponding load in the postpeak part of the quasi-static response. Finally, a fracture-based fatigue failure criterion is proposed.'),
  (107, 107, 'Modelling the post-cracking behaviour of steel fibre reinforced concrete for structural design purposes', 'Modelling the post-cracking behaviour of steel fibre reinforced concrete for structural design purposes', 'With the increasing number of applications in practice, the demand for standardised test methods and design rules for Steel Fibre Reinforced Concrete (SFRC) arises. Test methods need to be practical, which means that they have to be relatively cheap and simple to carry out. Design models should be easy to use and reliable. This paper presents a procedure to develop a post-cracking material relation for SFRC by means of inverse analysis. It shows that mean experimental results from three-point bending tests can be simulated with high accuracy using a bilinear stress-crack width relation. After determining the correct procedure to calculate the characteristic values, material safety factors are proposed dependent on the scatter in the post-cracking behaviour. Finally, a material relation is proposed that can be used for structural design purposes.'),
  (108, 108, 'Phase development in normal and ultra high performance cementitious systems by quantitative X-ray analysis and thermoanalytical methods', 'Phase development in normal and ultra high performance cementitious systems by quantitative X-ray analysis and thermoanalytical methods', NULL),
  (109, 109, 'Corrosion of steel fiber reinforced concrete', 'Corrosion of steel fiber reinforced concrete', 'The results of an extensive experimental investigation of the deterioration of steel fiber reinforced concrete due to fiber corrosion is presented. About 1200 specimens were tested. Two parallel test programs were conducted: one dealt with the effect of corrosion on steel fiber reinforced mortar specimens, and the other dealt with the effects of using precorroded fibers in mortar specimens. Different exposure periods with typical 3 days, cycling in 3.5 percent standard sodium-chloride solution and in laboratory air, respectively, were used with different solution temperatures. All experimental results seem to indicate that after a certain degree of corrosion has occurred, strength and toughness decrease with an increase in the degree of corrosion and that these mechanical properties are primarily affected by the reduction in minimum fiber diameter.'),
  (110, 110, 'Analysis of Reinforced Concrete Beams Subjected to Severe Concentrated Loads', 'Analysis of Reinforced Concrete Beams Subjected to Severe Concentrated Loads', NULL),
  (111, 111, 'High strength fiber reinforced concrete --static and fatigue behavior in bending', 'High strength fiber reinforced concrete --static and fatigue behavior in bending', NULL),
  (112, 112, 'Characterisation of fibres distribution in a steel fibre reinforced concrete with electrical resistivity measurements', 'Characterisation of fibres distribution in a steel fibre reinforced concrete with electrical resistivity measurements', 'Steel fibre reinforced concrete (SFRC) is a new material allowing innovative projects for concrete structures. Such structures are designed using assumptions on the material fabric. Checking these assumptions requires, according to recommendations, coring and mechanical testing of samples. Non-destructive assessment, if validated, would provide an interesting alternative, making the checking process easier, quicker and less expensive. Blind tests in laboratory compare electrical resistivity measurements obtained with a four-probes square device, to visual analysis during pouring. After having defined a measurement process, the representativity of electrical resistivity values is assessed by analysis of measurements on eight slabs. Electrical resistivity allows the identification of a high or low resistivity axis, which gives the local orientation of steel fibres. The calculation of electrical anisotropy gives an indication of the \"intensity of fibres orientation\" in each area. In this article, the complete analysis process is detailed on two slabs which have been casted according to two different fibres distributions. These tests confirm the ability of electrical resistivity method to provide data on steel fibres within concrete, via a non-destructive way. &copy; 2008 Elsevier Ltd. All rights reserved.'),
  (113, 113, 'Micromechanical aspects of the fibre-cement bond', 'Micromechanical aspects of the fibre-cement bond', 'The nature and properties of the interfacial region determine stress transfer between components of a composite and the development of the stress/strain curve, strength and the toughness of the composite. In this paper, the effect of the bonding on fibre pull-out, multiple cracking and strength, is considered. The measurement of the strength of the bonds is discussed.'),
  (114, 114, 'Orientation factor and number of fibers at failure plane in ring-type steel fiber reinforced concrete', 'Orientation factor and number of fibers at failure plane in ring-type steel fiber reinforced concrete', 'Considering the probabilistic distributions of fibers in ring-type steel fiber reinforced concrete, the orientation factor and the number of ring-type steel fibers crossing the failure plane were theoretically derived as a function of fiber geometry, specimen dimensions, and fiber volume fraction. A total number of 24 specimens were tested incorporating different fiber types, specimen geometry, and fiber volume fractions of 0.2% and 0.4%: 5 beams and 5 panels containing straight steel fibers; and 6 beams and 8 panels containing ring-type steel fibers. Measurements were made to assess the number of fibers at fractured surfaces of steel fiber reinforced concrete. The developed theoretical expressions reasonably predicted the orientation factor and the number of ring-type steel fibers at failure plane: the average and the standard deviation for the ratios of the test to theory were 1.03 and 0.26, respectively. Theoretical investigations and comparisons were made for the values of orientation factor and the number of fibers at failure plane for straight steel fibers and ring-type steel fibers. 2009 Elsevier Ltd. All rights reserved.'),
  (115, 115, 'An overview of the fatigue behaviour of plain and fibre reinforced concrete', 'An overview of the fatigue behaviour of plain and fibre reinforced concrete', 'The paper provides a general overview of recent developments in the study of the fatigue behaviour of plain and fibre reinforced concrete (FRC). The fatigue performance of plain concrete and FRC, as reported in the literature, is compared in order to quantify the influence of fibre inclusion on fatigue behaviour. Despite the conflicting information regarding the fatigue behaviour of concrete reported in the literature, the majority of researchers show that the inclusion of fibres can benefit the fatigue performance of concrete. 2003 Elsevier Ltd. All rights reserved.'),
  (116, 116, 'Effect of fiber inclination on crack bridging stress in brittle fiber reinforced brittle matrix composites', 'Effect of fiber inclination on crack bridging stress in brittle fiber reinforced brittle matrix composites', 'The mechanical behavior of brittle matrix composites is strongly affected by the bridging of cracks by fibers. In random fiber composites, fibers can lie at an angle to the crack plane. Under such conditions, the bridging stress for a certain crack opening is governed by various micromechanisms including fiber debonding, fiber bending and rupture as well as matrix spalling. While fiber debonding has been widely investigated, the coupled fiber bending/matrix spalling mechanism has received little attention. In this paper, the fiber bending/matrix spalling mechanism is analyzed by treating the fiber as a beam bent on an elastic foundation with variable stiffness and the possibility of spalling. The foundation stiffness and spalling criterion are derived from a finite element analysis. The bridging stress due to bending alone as well as the total bridging stress are then obtained for the case with brittle fibers. Through this analysis, the effect of various microstructural parameters (such as fiber and matrix moduli, matrix spalling strain and fiber/matrix interfacial friction) on the behavior of random fiber composites can be studied. Prediction of maximum bridging stress for inclined fibers based on the present model is shown to be in good agreement with experimental results.'),
  (117, 117, 'Optimal steel fiber strength for reinforcement of cementitious materials', 'Optimal steel fiber strength for reinforcement of cementitious materials', 'Steel fiber is the most common type of fiber reinforcement in cementitious materials. The reinforcement efficiency, in terms of maximum crack bridging force and total energy absorption during fiber pullout, is a function of many parameters including the properties of fiber, matrix, and interface as well as fiber size, volume fraction, geometry, and distribution. In this investigation, we focus on the effect of fiber yield strength on reinforcement efficiency. Fiber pullout specimens are fabricated with fibers of different yield strengths. Because cracks in a concrete member may intersect fibers at different angles, pullout tests are carried out with the fiber inclined at 0, 30, and 60. The experimental results indicate the existence of an optimal fiber yield strength for the maximization of pullout load and pullout work. Inspection of the pullout curves as well as microscopic studies show that a higher fiber yield strength will result in more severe matrix spalling around the fiber exit point, thus limiting the further improvement in reinforcement efficiency. The results confirm the qualitative trend predicted by an existing theoretical model and indicate that the fiber yield strength is an important parameter that should not be overlooked in the design of fiber reinforced cementitious composites.'),
  (118, 118, 'Determination of interfacial debond mode for fiber-reinforced cementitious composites', 'Determination of interfacial debond mode for fiber-reinforced cementitious composites', 'Theoretical models of mechanical properties of fiber reinforced cementitious composites require assumptions of fiber-cement interfacial behavior. In this paper, strength-based and fracture-based fiber debonding criteria are reviewed. To determine whether interfacial debonding is governed by the bond strength or critical energy release rate of the fiber-matrix interphase, fiber pull-out experiments were conducted using steel and brass wires of various diameters. The bond properties, including effective bond strength and frictional stress, were interpreted through a theoretical model of fiber pull-out. It was found that, for the material systems tested, interfacial debonding is dominated by frictional stress which is independent of the fiber diameters. Therefore, the debond mode of these material systems is categorized as strength-based. In general, the debond mode is a material characteristic and is dependent on the specific fiber and matrix types. In order to precisely predict the mechanical response of a fiber reinforced cementitious composite, it is necessary to determine the debond mode for a particular material system following the methodology proposed in this paper.'),
  (119, 119, 'Repair and retrofit with engineered cementitious composites', 'Repair and retrofit with engineered cementitious composites', NULL),
  (120, 120, 'Effect of inclining angle, bundling and surface treatment on synthetic fibre pull-out from a cement matrix', 'Effect of inclining angle, bundling and surface treatment on synthetic fibre pull-out from a cement matrix', 'In an experimental investigation of synthetic fibre pull-out at an angle, it was generally observed that the force and energy of fibre pull-out increase with the inclination angle, but such increases are limited by the strength of the cement matrix at high angles due to matrix spalling. Studies were also conducted on the effects of fibre bundling and surface treatment on the pull-out behaviour. It is suggested that for effective use of the reinforcing fibres, fibre bundling should be minimized and the fibre/matrix bond property should be controlled.'),
  (121, 121, 'Crack bridging in fiber reinforced cementitious composites with slip-hardening interfaces', 'Crack bridging in fiber reinforced cementitious composites with slip-hardening interfaces', 'A new crack bridging model accounting for slip-hardening interfacial shear stress is derived for randomly oriented discontinuous flexible fibers in cement-based composites, based on a micromechanics analysis of single fiber pull-out. The complete composite bridging stress versus crack opening curve ([sigma]B - [delta] relation) and associated fracture energy are theoretically determined. A micromechanics-based criterion which governs the existence of post-debonding rising branch of the [sigma]B - [delta] curve is obtained. Implications of the present model on various composite properties, including uniaxial tensile strength, flexural strength, ductility and critical fiber volume fraction for strain-hardening, are discussed together with an example of a 2% polyethylene fiber reinforced cement composite. It is found that the present model can very well describe the slip-hardening behavior during fiber pull-out which originates from fiber surface abrasion at fiber/matrix interface. In addition, the new model predicts accurately the enhanced toughness in terms of both ultimate tensile strain and fracture energy of the composite and resolves the deficiency of constant interface shear stress model in predicting the crack opening and ultimate strain, which are critical for material design of pseudo strain hardening engineered cementitious composites (ECCs).'),
  (122, 122, 'Meso-scale cracking-bridging model of inclined fiber in steel fiber reinforced cementitious composites', 'Meso-scale cracking-bridging model of inclined fiber in steel fiber reinforced cementitious composites', 'The crack-bridging behavior of inclined steel fiber in cementitious composites was discussed at meso-scale. The embedded part of the fiber in the cementitious composites was assumed to act as a bar. while the part of the fiber outside the matrix was simplified into two configurations, cantilever beam for elastic fiber and plastic joint for elastoplastic fiber. The Naaman\'s shear lag model was adopted for the axial control relation. A concept of lateral effective load-bearing area was adopted to simplify the description of the effects of local spalling or crushing in matrix around the fiber. An analytical debonding and pullout model for high modulus inclined fiber was constructed. Results show that the model can preliminarily simulate the elastoplastic pullout behavior of inclined high modulus crack-bridging fiber.'),
  (123, 123, 'Creep of Ultra High Performance Concrete', 'Creep of Ultra High Performance Concrete', NULL),
  (124, 124, 'Stainless steel rebar', 'Stainless steel rebar', 'Focuses on the use of high strength, corrosion resistant stainless steel rebar as concrete reinforcement in bridges, highways and buildings. Accounts on the possible applications for corrosion-resistant stainless rebar; Factors necessary to preserve structural integrity of steel; Nonmagnetic attributes and corrosion resistance of alloys. INSET: A bridge in Oregon.'),
  (125, 125, 'Effect of bond, aggregate interlock and dowel action on the shear strength degradation of reinforced concrete', 'Effect of bond, aggregate interlock and dowel action on the shear strength degradation of reinforced concrete', 'The macroscopic shear strength contribution of concrete in reinforced concrete members is supported by dowel action, aggregate interlocking across tension-shear cracks and the tensile stress field that becomes mobilised in concrete through reinforcement concrete bond. The mechanics of this relationship are explored in this paper for the benefit of improved understanding of the degradation of shear strength in reinforced concrete as a function of imposed deformation demand. The mathematical formulation uses the non-linear smeared crack/smeared reinforcement approach to consider plane stress states in reinforced concrete elements. The critical modelling assumption in assessing the concrete contribution to shear resistance was the representation of force transfer from bar to concrete, which requires establishing equilibrium both at crack locations as well as in a global sense. The significance of this modelling approach on the overall shear strength was evaluated by the comparison of computed results with those obtained from the conventional model, wherein concrete participation is lumped artificially under the so-called [`]tension-stiffening\' property. From this comparison the parametric dependence of tension stiffening on bar diameter, crack spacing and bond properties is illustrated. Through the mathematical formulation it was possible to identify and highlight the effect that compression softening of the concrete struts has on the contribution of the web reinforcement to shear resistance, which represents yet another source of globally observed strength degradation. The proposed model was verified by comparison with experimental results and was subsequently used for parametric investigation of the associated design problem.'),
  (126, 126, 'Compression Field Modeling of Fiber-Reinforced Concrete Members Under Shear Loading', 'Compression Field Modeling of Fiber-Reinforced Concrete Members Under Shear Loading', NULL),
  (127, 127, 'Characteristics of microcracking in concrete under static and repeated tensile loading', 'Characteristics of microcracking in concrete under static and repeated tensile loading', 'The type and amount of microcracking in normal weight concrete were determined by the direct observation of the slices cut from the necked prismatic specimens subjected to static and repeated tensile loads. It was found from the results of observation under static tensile loading that bond cracks increased almost linearly with increasing load and that mortar cracks developed extensively at about 100% of the ultimate load. The results under repeated tensile loading indicated that the repetitive nature of loading merely conduced to a slight increase in the total amount of internal microcracking. The relations between these findings and two features of the tensile fatigue previously reported were discussed.'),
  (128, 128, 'Modeling of stiffness degradation of the interfacial zone during fiber debonding', 'Modeling of stiffness degradation of the interfacial zone during fiber debonding', 'The frictional nature of fiber pullout is a major reinforcing mechanism in brittle matrix composites. The objective of present work is to develop an interface failure model for use as a closing pressure formulation. A fracture mechanics model for the debonding of a fiber from a cementitious matrix is used to calculate the stiffness degradation due to propagation of a stable debonding zone. A formulation based on the growth of a mode II crack along an elastic-perfectly plastic 1-D interface is used. The crack growth criterion is defined using the strain energy release rate of a partially debonded interface. It is assumed that the fracture toughness of the interface increases as a function of the debonded length in the form an an R-Curve approach. In addition, a frictional shear stress of constant magnitude acts over the debonded length. The R-Curve parameters are obtained by numerical solution of the resulting differential equations. The load-slip response is obtained from the R-Curves, and a parametric study of fiber type, length, and interface properties are conducted. Results are compared with a finite element model based on Coulomb frictional models.'),
  (129, 129, 'Uniaxial Shear-Flexure Model for Reinforced Concrete Elements', 'Uniaxial Shear-Flexure Model for Reinforced Concrete Elements', NULL),
  (130, 130, 'FEA of Complex Bridge System with FRP Composite Deck', 'FEA of Complex Bridge System with FRP Composite Deck', NULL),
  (131, 131, 'Shear Strength of Members without Transverse Reinforcement as Function of Critical Shear Crack Width', 'Shear Strength of Members without Transverse Reinforcement as Function of Critical Shear Crack Width', 'This paper investigates the shear strength of beams and one-way slabs without stirrups based on the opening of a critical shear crack. The shear-carrying mechanisms after the development of this crack are investigated. On this basis, a rational model is developed to estimate the shear strength of members without shear reinforcement. The proposed model is based on an estimate of the crack width in the critical shear region, taking also into account the roughness of the crack and the compressive strength of concrete. The proposed model is shown to properly describe a large set of available test data. A simplified method adopted by the Swiss code for structural concrete (SIA 262) is also introduced. Comparisons with other codes of practice are finally presented, with a highlight on the main differences between them.'),
  (132, 132, 'Innovative Bridge Deck System Using High-Performance Fiber-Reinforced Cement Composites', 'Innovative Bridge Deck System Using High-Performance Fiber-Reinforced Cement Composites', 'This study describes the basis for an innovative concept related to building better and more durable concrete bridge decks. The decks are assumed to be supported by beams of any structural material (for example, steel, concrete, and wood). The typical deck is made with high-performance fiber-reinforced cement composites (HPFRCC) and reinforced with only one layer of transverse (normal to the supporting beam axis) bottom reinforcing bars (steel or fiber-reinforced polymer [FRP]) for positive moment resistance. Thus, the reinforcement is as far away as possible from the top surface of the deck and protected from intrusion of corrosive agents. The HPFRCC is designed to: 1) balance part of the negative moment; 2) allow the development of an effective plastic hinge mechanism, with hinges forming at supports and in spans, under ultimate loading; and 3) keep crack widths extremely small under service conditions. A dramatically higher durability is expected. When the bottom reinforcement is prestressed, beneficial secondary moments are created at the supports, helping to improve overall performance. A brief summary of test results and analytical modeling is given in this paper.'),
  (133, 133, 'Bond-slip mechanisms of steel fibers in concrete', 'Bond-slip mechanisms of steel fibers in concrete', 'A comprehensive experimental program on pullout and pullthrough tests of steel fibers from a cement-based matrix is described. Emphasis is placed on the accurate measurements of the pullout load versus end-slip response. Parameters included three different types of fibers (smooth, deformed, and hooked), three different mortar matrixes with low, medium, and high strengths, one cement-based slurry matrix, and additives such as latex, fly ash, and microsilica. The medium from which the fiber was pulled out included a control mortar mix without fibers, mortar mixes with 1, 2, and 3 percent fibers by volume, and a SIFCON matrix containing about 11 percent fibers by volume. For smooth fibers, five different diameters and three different embedment lengths were investigated. Experimental pullout load versus slip curves are needed to derive typical bond shear stress versus slip curves considered to be a property of the interface.'),
  (136, 136, 'Proposed classification of HPFRC composites based on their tensile response', 'Proposed classification of HPFRC composites based on their tensile response', 'The tensile response of fiber reinforced cement (FRC) composites can be generally classified in two distinct categories depending on their behavior after first cracking, namely, either strain-hardening or strain-softening. Within the strain-softening category, one can distinguish between deflection-hardening and deflection-softening behavior. Several standard tests (ASTM, JCI, RILEM) are available to assess the characteristics of mostly strain-softening FRC composites through bending tests, but no standard test is currently available to characterize strain-hardening response in tension. Such composites have been described as high performance FRC or HPFRC composites. In this paper a proposal is put forth to characterize the response of strain-hardening FRC composites based on the results of direct tensile tests. The classification is based on several parameters which include a minimum value of elastic modulus, a minimum value of peak strain after first cracking, and the tensile strength level. While one of the key obstacles remains, that is, to develop a realistic and meaningful tensile test standard, some requirements on minimum specimen size, fiber size and aggregate size are also suggested. RILEM 2006.'),
  (137, 137, 'REEVALUATION OF TEST DATA ON DEVELOPMENT LENGTH AND SPLICES', 'REEVALUATION OF TEST DATA ON DEVELOPMENT LENGTH AND SPLICES', 'An equation is developed for calculating development and splice lengths for deformed bars. The equation is based on a nonlinear regression analysis of test results of beams with lap splices and reflects the effect of length, cover, spacing, bar diameter, concrete strength, and transverse reinforcement on the strength of anchored bars. Design recommendations are proposed and compared with current provisions for development splice length.'),
  (138, 138, 'Crack/fiber interaction and crack growth resistance behavior in microfiber reinforced mortar specimens', 'Crack/fiber interaction and crack growth resistance behavior in microfiber reinforced mortar specimens', 'Performance enhancement due to microfibers is well known. However, fracture processes that lead to strain hardening behavior in microfiber reinforced composites are not well understood. Crack growth resistance behavior of mortar reinforced with steel microfibers and polypropylene microfibers was investigated in-situ during load application. The polypropylene fibers were inter-ground in the cement mill to enhance the fiber/matrix interfacial frictional stress. A more homogeneous fiber distribution was observed in the inter-ground polypropylene composites compared to the steel microfiber reinforced composites. In steel microfiber reinforced composites the dominant toughening mechanisms were multiple microcracking and successive debonding along the fiber/matrix interface. Fiber pullout, the dominant mechanism in conventional macrofiber reinforced composites was rarely observed. In-situ observation of crack/fiber interaction in the inter-ground polymer fibers also revealed multiple microcracking along the length of the fibers followed by fiber pullout. 2006 RILEM.'),
  (139, 139, 'Non-destructive monitoring of fiber orientation using AC-IS: An industrial-scale application', 'Non-destructive monitoring of fiber orientation using AC-IS: An industrial-scale application', 'A comprehensive study has been undertaken to investigate the ability of AC-impedance spectroscopy (AC-IS) to non-destructively monitor the fiber dispersion of conductive fiber-reinforced cement-based materials. Previous work showed that AC-IS effectively monitors various fiber dispersion issues in lab-scale steel fiber-reinforced specimens. In this part of the study, AC-IS was used to study fiber orientation in an industrial-scale pre-cast concrete beam. A conventional method-image analysis (IA)-was used to verify the results of AC-IS measurements. The results of AC-IS and IA were found to match very well in experimental uncertainty. Splitting tensile tests and bending tests were conducted on the parts of the beam to study the effects of fiber orientation on the mechanical performance. The results of the mechanical tests also confirmed the results of AC-IS with splitting tensile strengths increasing as the alignment of fibers increased. 2006 Elsevier Ltd. All rights reserved.'),
  (140, 140, 'Monitoring Fiber Dispersion in Fiber-Reinforced Cementitious Materials: Comparison of AC-Impedance Spectroscopy and Image Analysis', 'Monitoring Fiber Dispersion in Fiber-Reinforced Cementitious Materials: Comparison of AC-Impedance Spectroscopy and Image Analysis', NULL),
  (142, 142, 'Steel Fiber Reinforced Concrete Beams Under Bending, Shear And Torsion Without Web Reinforcement', 'Steel Fiber Reinforced Concrete Beams Under Bending, Shear And Torsion Without Web Reinforcement', 'The results of six bending, shear and torsion tests on steel fiber reinforced rectangular concrete beams without web reinforcement are presented and discussed. The variable parameter is longitudinal steel at bottom only. The top reinforcement, aspect ratio and volume fraction of steel fibers kept constant for all the beams. From the tests conducted, it was found that the torsional strength is independent of longitudinal reinforcement. The experimental results were compared with the modes of failure proposed by Mansur and Mansur and Paramasivam under combined bending, shear and torsion for SFRC beams and Dr. V. Ramakrishnan and Vijayarangan for beams without web reinforcement under combined torsion and bending. It is shown that experimental results compare favorably with the theoretical predictions.'),
  (143, 143, 'Interfacial and microfailure evaluation of modified single fiber-brittle cement matrix composites using an electro-micromechanical technique and acoustic emission', 'Interfacial and microfailure evaluation of modified single fiber-brittle cement matrix composites using an electro-micromechanical technique and acoustic emission', 'Interfacial and microfailure properties of the modified steel, carbon, and glass fiber-cement composites were investigated using the electro-pullout test under tensile and compressive tests with acoustic emission (AE). The hand-sanded steel composite exhibited higher interfacial shear strength than the untreated and even neoalkoxy zirconate (Zr) treated steel fiber composites. This might be due to the enhanced mechanical interlocking, compared to possible hydrogen or covalent bonds. During the curing process, the contact resistivity decreased rapidly at the initial stage and then leveled off. Compared to the untreated case, the contact resistivity of either Zr-treated or hand-sanded steel fiber composites increased to infinity at the latter stage. The number of AE signals of hand-sanded steel fiber composite was much greater than those of the untreated and Zr-treated cases because of many interlayer failure signals. AE waveforms for pullout and frictional signals of the hand-sanded composite are larger than those of the untreated case. Under compressive loading for dual matrix composite, AE energy was much higher and the waveform was larger than those under tensile loading, because of their brittle but well-enduring ceramic nature against compressive stress. Vertical multicrack exhibits for the glass-fiber composite under tensile test, whereas buckling failure appeared under compressive loading. The electro-micromechanical technique with AE can be used as an efficient nondestructive method to evaluate the interfacial and microfailure mechanisms for conductive fiber-cement composites of the brittle and nontransparent type. 2001 Elsevier Science.'),
  (144, 144, 'Multiple Cracking and Fiber Bridging Characteristics of Engineered Cementitious Composites under Fatigue Flexure', 'Multiple Cracking and Fiber Bridging Characteristics of Engineered Cementitious Composites under Fatigue Flexure', NULL),
  (145, 145, 'INELASTIC BEHAVIOUR IN STEEL WIRE PULL-OUT FROM PORTLAND CEMENT MORTAR', 'INELASTIC BEHAVIOUR IN STEEL WIRE PULL-OUT FROM PORTLAND CEMENT MORTAR', 'This paper describes a study of the factors influencing the pull-out force of stainless steel wires embedded in Portland cement mortar. The first part provides a theoretical elastic analysis of the pull-out force in terms of the misfit between wire and matrix, the coefficient of friction at the wire-matrix interface and the elastic constants of the materials. The resulting equation shows that the behavior is greatly influenced by the Poisson contraction of the wire during pull-out. Since the elastic modulus of the mortar is only five or six times smaller than that of the wire this can lead to a large reduction in stress-transfer across the wire-matrix interface and a corresponding reaction in pull-out force. In general the pull-out force is extremely sensitive to the wire-matrix misfit. The second part deals with an experimental study of the effect of surface finish of the wire and the effect of an externally applied confining pressure. The paper concludes with a discussion of the significance of this non-elastic behavior in the practical performance of fiber reinforced mortars and the role of mechanical deformations of the fibers.'),
  (146, 146, 'Nuclear magnetic resonance characterization of high- and ultrahigh-performance concrete: Application to the study of water leaching', 'Nuclear magnetic resonance characterization of high- and ultrahigh-performance concrete: Application to the study of water leaching', 'In the present study, we show that high-resolution 29Si and 27Al magic angle spinning (MAS) nuclear magnetic resonance (NMR) can be a powerful tool for analyzing actual concrete mixes. The influence of the amount of silica fume and of the type of cement in high-performance concrete (HPC), as well as the influence of the type of silica fume and of the granular packing in ultrahigh-performance concrete (UHPC) were investigated. Significant effects on the amount and shape of C-S-H, on the incorporation of aluminum in the C-S-H structure, and on the distribution of aluminum-containing hydrates were observed. Nuclear magnetic relaxation of protons was also performed and it showed the fractal feature of the pore size distribution in UHPC and the higher amount of larger pores in HPC. The microstructure of the surface of these same formulations leached by mineral water for up to 1 year exhibits slight modifications.'),
  (147, 147, 'Performance Evaluation of FRP Bridge Deck Component under Torsion', 'Performance Evaluation of FRP Bridge Deck Component under Torsion', NULL),
  (148, 148, 'Prediction of steel fibre reinforced concrete under flexure from an inferred fibre pull-out response', 'Prediction of steel fibre reinforced concrete under flexure from an inferred fibre pull-out response', 'Steel fibre-reinforced concrete (SFRC) is being used in a variety of structural applications, yet there is still considerable debate how to express and evaluate flexural toughness for design purposes. This is holding back the material\'s development as a permanent structural material. Existing beam and slab test methods have problems with variability or their application in structural design. Furthermore, existing models of SFRC flexural behaviour do not fully capture what happens at the cracked section in terms of the fibre-matrix interactions. Typical of these approaches is the modelling of the tension zone from single fibre pull-out tests, which is problematic in measurement of the load-displacement relationship, the interaction of groups of fibres and the extensive testing required to cover all permutations of fibre geometry. An alternative approach is proposed where the average pull-out response of the fibres bridging the cracked zone is inferred from flexural beam tests. The characteristic load versus crack-mouth opening displacement behaviour for a particular fibre concrete then forms part of the stress and strain/displacement profile in a flexural analysis to predict moment capacity in a design calculation. The model is explained together with its validation by comparing the predicted load-displacement response for a range of fibre volumes in sprayed and cast SFRC. It is concluded that the analysis of beam load/deflection curves to infer the fibre pull-out response is a viable approach. It offers a promising solution to the need for a flexural design model combined with a practical method of characterizing the tensile contribution of steel fibres. RILEM 2006.'),
  (149, 149, 'Analytical model for the torsional response of steel fiber reinforced concrete members under pure torsion', 'Analytical model for the torsional response of steel fiber reinforced concrete members under pure torsion', 'Rausch space truss theory (1925) is the earliest theory to predict the torsional response of RC members subjected to pure torsion. Softened truss theory proposed by Hsu considering the softening effect of concrete fairly estimates the torsional strength of the members under pure torsion. These theories consider the member to be a cracked one, so that the truss action activates. This assumption reduces the initial torsional stiffness of the cross-section. However the model proposed by Hsu considering the softening effect of concrete fairly estimates the ultimate torque carrying capacity of the RC member. Fiber reinforced concrete is a better option in the construction of blast resistant and earthquake resistant structures. Relatively little research has been reported on the analytical studies of SFRC members subjected to pure torsion. Thus in this paper an attempt has been made to develop an analytical model for predicting the torque-twist response of SFRC members subjected to pure torsional loads considering the softening effect of concrete. Experimental validation was also presented in this paper. Published by Elsevier Ltd.'),
  (150, 150, 'Reactive Powder Concrete Bridges', 'Reactive Powder Concrete Bridges', NULL),
  (151, 151, 'Assessment of fiber orientation in reinforced concrete using fourier image transform', 'Assessment of fiber orientation in reinforced concrete using fourier image transform', NULL),
  (152, 152, 'Behavior of bars in dowel acion against concrete cover', '', ''),
  (153, 153, 'Tensile Tests and Failure Analysis of Concrete', 'Tensile Tests and Failure Analysis of Concrete', NULL),
  (154, 154, 'Behavior of high-performance concrete under uniaxial and biaxial loading', 'Behavior of high-performance concrete under uniaxial and biaxial loading', 'A systematic experimental research was carried out to investigate the mechanical properties of high-performance concrete (HPC). A total of 91 plate specimens were tested in four different loading conditions including uniaxial tension, uniaxial compression, biaxial compression, and tension compression with the help of a closed-loop testing machine. Uniaxial and biaxial complete stressstrain curves were obtained under a strain control loading scheme. Based on the stochastic process theory, the average curves and standard deviation curves were obtained for uniaxial loading conditions. The rehardening of concrete after having entered the softening stage was observed in this experiment. The ultimate strength envelopes in both stress and strain space were developed through parameter identification of the complete stress-strain curves. This research laid a foundation for further research on the multiaxial constitutive law of concrete. Copyright 2008, American Concrete Institute. All rights reserved,.'),
  (155, 155, 'Reactive powder concretes with high ductility and 200-800 MPa compressive strength', 'Reactive powder concretes with high ductility and 200????Â¡Â¥??aâ‚¬???aâ‚¬???Â¨Â¦a??a??Â¨Â¦????Â¡Â¥??Â¨Â¦a??????aâ‚¬?????Â¨Â¦????Â¡Â¥??aâ‚¬???aâ‚¬?????Â¨Â¦????Â¡Â¥????Â¨Â¦????Â¨Â¦??Â¨Â¦a??????????aâ‚¬|????????Â¡Â¥??Â¨Â¦a??????aâ‚¬?????????Â¡Â¥??aâ‚¬???aâ‚¬?????Â¨Â¦????Â¡Â¥????Â¨Â¦????Â¨Â¦??Â¨Â¦aâ‚¬?????-????aâ‚¬?????????Â¡Â¥??Â¨Â¦a???|????Â¨Â¦??Â¨Â¦aâ‚¬?????-aâ‚¬?800 MPa compressive strength', ''),
  (156, 156, 'Composition of reactive powder concretes', 'Composition of reactive powder concretes', 'Development of an ultra-high strength ductile concrete designated RPC (Reactive Powder Concrete), was made possible by the application of a certain number of basic principles relating to the composition, mixing and post-set heat curing of the concrete. RPC 200, which can be used under job site conditions similar to those for conventional high performance concretes, can be used in the construction of prestressed structures incorporating no passive reinforcement. RPC800 is suitable for precasting, and can achieve compressive strength values exceeding 600MPa. A value of 810MPa has been obtained with a mixture incorporating steel aggregate.'),
  (157, 157, 'Long term random dynamic loading of concrete structures', 'Long term random dynamic loading of concrete structures', NULL),
  (158, 158, 'Light-Weight Fiber-Reinforced Polymer Composite Deck Panels for Extreme Applications', 'Light-Weight Fiber-Reinforced Polymer Composite Deck Panels for Extreme Applications', NULL),
  (159, 159, 'Development of new cement composite materials for construction', 'Development of new cement composite materials for construction', 'For almost ten years ultra-high-performance fibre-reinforced concrete (UHPFRC) has been developed throughout the world. After a reviewing and carrying out a critical analysis of the different UHPFRCs which exist, and some prospects related to these materials, a new cementitious composite, patented by the Laboratoire Central des Ponts et Chauss????Â¡Â¥??aâ‚¬???aâ‚¬???Â¨Â¦a??a??Â¨Â¦????Â¡Â¥??Â¨Â¦a??????aâ‚¬?????Â¡Ã¬????Â¡Â¥??aâ‚¬?????Â¨Â¦??Â¨Â¦aâ‚¬??????|????Â¡Â¥????Â¨Â¦????Â¨Â¦??Â¨Â¦a????????????Â¨Â¦??Â¨Â¦a????????Â¨Â¦????Â¡Â¥??aâ‚¬???aâ‚¬?????Â¨Â¦????Â¡Â¥????Â¨Â¦????Â¨Â¦??Â¨Â¦aâ‚¬?????-????aâ‚¬?????????Â¡Â¥??Â¨Â¦a??????aâ‚¬????|es (LCPC) in France, is presented. This UHPFRC has such good mechanical behaviour in tension that it is possible to construct structures or manufacture structural members without reinforcement in addition to the fibres. [ABSTRACT FROM AUTHOR]'),
  (160, 160, 'Applications of Critical Shear Crack Theory to Punching of Reinforced Concrete Slabs with Transverse Reinforcement', 'Applications of Critical Shear Crack Theory to Punching of Reinforced Concrete Slabs with Transverse Reinforcement', 'The traditional approach of codes of practice for estimating the punching strength of shear-reinforced flat slabs is based on the assumption that concrete carries a fraction of the applied load at ultimate while the rest of the load is carried by the shear reinforcement. Concrete contribution is usually estimated as a fraction of the punching strength of members without shear reinforcement. The ratio between the concrete contribution for members with and without shear reinforcement is usually assumed constant, independent of the amount of shear reinforcement, flexural reinforcement ratio, and bond conditions of the shear reinforcement. The limitations of such an approach are discussed in this paper and a new theoretical model, based on the critical shear crack theory, is presented to investigate the strength and ductility of shear-reinforced slabs. The proposed approach is based on a physical model and overcomes most limitations of current codes of practice. Its application to various punching shear reinforcement systems is also detailed in the paper and its results are compared to available test data.'),
  (161, 161, 'Experimental Evaluation of Aluminum Bridge Deck System', 'Experimental Evaluation of Aluminum Bridge Deck System', NULL),
  (162, 162, 'Ultra-high performance concrete bridge deck reinforced with high strength steel', 'Ultra-high performance concrete bridge deck reinforced with high strength steel', 'There is currently a need to develop lightweight bridge deck systems with solid riding surfaces to replace the open-grid steel decks from moveable bridges. Open-grid steel decks present several problems, including poor rideability, high noise levels, susceptibility to fatigue damage, and high maintenance costs. There is a great opportunity to use advanced materials, such as ultra-high-performance concrete (UHPC), to develop new lightweight bridge deck systems. In this study, a low-profile UHPC deck system has been developed that satisfies the strength and serviceability requirements, addresses the concerns with open-grid steel decks, and meets the strict self-weight requirements for moveable bridges. The detailed experimental study shows that the proposed system has great potential to serve as an alternative to open-grid steel decks. Shear was the governing mode of failure in most of the specimens; however, it was not as abrupt and catastrophic as the commonly seen shear failure mode. Standard 180-degree hooks on both ends of the flexural reinforcement help avoid bond failure. The establishment of the development length of high-strength steel for UHPC, deck-deck connection, deck-girder connection, and fatigue performance still need to be investigated before the system is ready for implementation.'),
  (163, 163, 'Behavior of concrete bridge decks reinforced with high-performance steel', 'Behavior of concrete bridge decks reinforced with high-performance steel', 'This paper describes the behavior of concrete bridge decks reinforced with newly developed high-performance (HP) steel that is characterized by its high sirength and enhanced corrosion-resistance in comparison with conventional ASTM A615-06 Grade 60 steel. The study presented herein included testing of three full-scale bridge decks with a span-depth ratio of 12.5. The first and second decks were constructed with the same reinforcement ratio using HP and Grade 60 steel, respectively. The third deck was reinforced with HP steel using 33% less reinforcement in an attempt to use its high strength. A nonlinear finite element model was used to predict the mode of failure and failure loads. Test results demonstrate that the use of HP steel at a reduced reinforcement ratio is viable as flexural reinforcement in concrete bridge decks. The paper also presents the test results of specially-designed specimens to study the effect of bending of HP steel bars on their tensile strength. &copy; 2008, American Concrete Institute. All rights reserved.'),
  (164, 164, 'Constant life diagrams-a historical review', 'Constant life diagrams- a historical review', 'A historical review of the early development of constant life diagrams (variously referred to as Goodman, Smith, Haigh, etc. diagrams) is presented. It is shown that there were two distinct approaches to the formulation of constant life diagrams for fatigue design purposes. The first one was based on W????Â¡Â¥??aâ‚¬???aâ‚¬???Â¨Â¦a??a??Â¨Â¦????Â¡Â¥??Â¨Â¦a????????Â¨Â¦??Â¨Â¦aâ‚¬?????Â¨Â¦aâ‚¬???Â¨Â¦????Â¡Â¥??aâ‚¬?????Â¨Â¦??Â¨Â¦aâ‚¬?????-??????Â¡Â¥??Â¨Â¦a??????aâ‚¬?????hler\'s fatigue experiments and involved engineering curve fits of the fatigue endurance data. The Launhardt????Â¡Â¥??aâ‚¬???aâ‚¬???Â¨Â¦a??a??Â¨Â¦????Â¡Â¥??Â¨Â¦a??????aâ‚¬?????Â¨Â¦????Â¡Â¥??aâ‚¬???aâ‚¬?????Â¨Â¦????Â¡Â¥????Â¨Â¦????Â¨Â¦??Â¨Â¦a??????????aâ‚¬|????????Â¡Â¥??Â¨Â¦a??????aâ‚¬?????????Â¡Â¥??aâ‚¬???aâ‚¬?????Â¨Â¦????Â¡Â¥????Â¨Â¦????Â¨Â¦??Â¨Â¦aâ‚¬?????-????aâ‚¬?????????Â¡Â¥??Â¨Â¦a???|????Â¨Â¦??Â¨Â¦aâ‚¬?????-aâ‚¬?Weyrauch, Gerber and Johnson formulae are the main representatives of this approach. The second approach is based on the dynamic theory used for bridge design. The Fidler????Â¡Â¥??aâ‚¬???aâ‚¬???Â¨Â¦a??a??Â¨Â¦????Â¡Â¥??Â¨Â¦a??????aâ‚¬?????Â¨Â¦????Â¡Â¥??aâ‚¬???aâ‚¬?????Â¨Â¦????Â¡Â¥????Â¨Â¦????Â¨Â¦??Â¨Â¦a??????????aâ‚¬|????????Â¡Â¥??Â¨Â¦a??????aâ‚¬?????????Â¡Â¥??aâ‚¬???aâ‚¬?????Â¨Â¦????Â¡Â¥????Â¨Â¦????Â¨Â¦??Â¨Â¦aâ‚¬?????-????aâ‚¬?????????Â¡Â¥??Â¨Â¦a???|????Â¨Â¦??Â¨Â¦aâ‚¬?????-aâ‚¬?Goodman formula is an example of this approach. The early proponents of the second approach questioned W????Â¡Â¥??aâ‚¬???aâ‚¬???Â¨Â¦a??a??Â¨Â¦????Â¡Â¥??Â¨Â¦a????????Â¨Â¦??Â¨Â¦aâ‚¬?????Â¨Â¦aâ‚¬???Â¨Â¦????Â¡Â¥??aâ‚¬?????Â¨Â¦??Â¨Â¦aâ‚¬?????-??????Â¡Â¥??Â¨Â¦a??????aâ‚¬?????hler\'s test results and did not believe that they could be used for design purposes. Finally, the first books on fatigue of metals introduced citation inaccuracies, which were propagated by subsequent authors.'),
  (165, 165, 'Interfacial (fiber-matrix) properties of high-strength mortar (150 MPa) from fiber pullout', 'Interfacial (fiber-matrix) properties of high-strength mortar (150 MPa) from fiber pullout', 'The steel fiber-matrix properties of high-strength mortar (150 MPa), such as DSP (densified small particle), are obtained and compared to an ordinary strength mortar (40 MPa) using a specially designed fiber pullout apparatus. A new method for estimating the debonding energy of the interfacial zone from the experimental pullout curve is presented. The method is used to separate the areas under the pullout curve corresponding to debonding and friction. The predictions are compared to other methods in the literature. The proposed method seems to provide less variations in the results. The high-strength DSP mortar has significantly improved interfacial properties compared to ordinary strength mortar. These results are important in the understanding of the role of steel fibers in improving the tensile properties of high-strength, brittle, cement-matrix composites.'),
  (166, 166, 'Pullout behavior of steel fibers from cement-based composites', 'Pullout behavior of steel fibers from cement-based composites', 'A comprehensive experimental program on pullout tests of steel fibers from cement based matrices is described. A specially designed single fiber pullout apparatus was used to provide a quantitative determination of interfacial properties that are relevant to toughening brittle materials through fiber reinforcement. The parameters investigated included a specially designed high strength cement based matrix called Densified Small Particles system (DSP), a conventional mortar matrix, fiber embeddment length, and the fiber volume fraction. The mediums from which the fiber was pulled included a control mortar mix without fibers, a mortar mix with 3, and 6 percent fibers by volume. The results indicate that: (1) The dense DSP matrix has significantly improved interfacial properties as compared to the conventional mortar matrix. (2) Increasing the fiber embeddment length and the fiber volume fraction in the cement matrix increase the peak pullout load and the pullout work. (3) The major bond mechanism in both systems is frictional sliding.'),
  (167, 167, 'The nano-mechanical signature of Ultra High Performance Concrete by statistical nanoindentation techniques', 'The nano-mechanical signature of Ultra High Performance Concrete by statistical nanoindentation techniques', 'Advances in engineering the microstructure of cementitious composites have led to the development of fiber reinforced Ultra High Performance Concretes (UHPC). The scope of this paper is twofold, first to characterize the nano-mechanical properties of the phases governing the UHPC microstructure by means of a novel statistical nanoindentation technique; then to upscale those nanoscale properties, by means of continuum micromechanics, to the macroscopic scale of engineering applications. In particular, a combined investigation of nanoindentation, scanning electron microscope (SEM) and X-ray Diffraction (XRD) indicates that the fiber-matrix transition zone is relatively defect free. On this basis, a four-level multiscale model with defect free interfaces allows to accurately determine the composite stiffness from the measured nano-mechanical properties. Besides evidencing the dominant role of high density calcium silicate hydrates and the stiffening effect of residual clinker, the suggested model may become a useful tool for further optimizing cement-based engineered composites. &copy; 2008 Elsevier Ltd. All rights reserved.'),
  (168, 168, 'Behavior of Bars in Dowel Action Against Concrete Cover', 'Behavior of Bars in Dowel Action Against Concrete Cover', NULL),
  (169, 169, 'Distribution and Orientation of Fibers in Steel Fiber Reinforced Concrete', 'Distribution and Orientation of Fibers in Steel Fiber Reinforced Concrete', 'Measurements were made of the number of fibers per unit cross-sectional area in steel fiber reinforced concrete specimens incorporating various volume fractions of fibers of different types. Based on statistical evaluation of the measured values, the differences in fiber concentration at different location on the cross section were assessed. Theoretical expressions were derived for the number of fibers per unit cross-sectional area in the fiber reinforced concrete, with due consideration given to the effects of the surrounding boundaries. The effects of vibration on reorientation of steel fibers in concrete were investigated through comparisons between the computed and measured values of number of fibers per unit cross-sectional area.'),
  (170, 170, 'Bearing Strength and Stiffness of Concrete Under Reinforcing Bars', 'Bearing Strength and Stiffness of Concrete Under Reinforcing Bars', NULL),
  (171, 171, 'Manufacturing, fibre anisotropy and fracture of hybrid fibre concrete', 'Manufacturing, fibre anisotropy and fracture of hybrid fibre concrete', 'In the paper an overview is presented of recent results obtained in a comprehensive research (in progress) on the relation between manufacturing processes, fibre anisotropy and fracture properties of hybrid fibre concrete containing three different types of steel fibres. Since manufacturing relates to specific fibre orientations and thus to specific fracture behavior, these parts of the research are presented together in this paper. The experiments conducted confirm that a strong increase of flexural strength and ductility can be obtained when fibres cocktails are applied. The fibres tend to align along the walls of moulds, and it is shown that these highly reinforced surface layers add significantly to the strength of the beams. The fibre alignment can be affected by the viscosity of the concrete mixture in the fresh state, which allows to \'place\' fibres at those locations where they are most needed. Finally, impregnation experiments show that pre-peak cracking is indeed in the form of multiple cracking, which localize into a major crack beyond peak. The localized crack is prevented to open rapidly by the bridging of the largest fibres present in the fibre cocktail. 2006 Elsevier Ltd. All rights reserved.'),
  (172, 172, 'Testing, Analysis, and Evaluation of a GFRP Deck on Steel Girders', 'Testing, Analysis, and Evaluation of a GFRP Deck on Steel Girders', NULL),
  (173, 173, 'The analysis of fibre distributions in fibre reinforced materials', 'The analysis of fibre distributions in fibre reinforced materials', NULL),
  (174, 174, 'Biaxial compression fatigue and discontinuity of concrete', 'Biaxial compression fatigue and discontinuity of concrete', NULL),
  (175, 175, 'Biaxial Compression Datigue and the Discontinuity of Concrete', 'Biaxial Compression Datigue and the Discontinuity of Concrete', NULL),
  (176, 176, 'Ultra-High Performance Concrete in Geotechnical and Substructure Applications', 'Ultra-High Performance Concrete in Geotechnical and Substructure Applications', NULL),
  (177, 177, 'Multiple cracking and fiber bridging characteristics of engineered cementitious composites under fatigue flexure', 'Multiple cracking and fiber bridging characteristics of engineered cementitious composites under fatigue flexure', 'The flexural fatigue characteristics of two different shotcreted engineered cementitious composites (ECCs) containing polyvinyl alcohol (PVA) and polyethylene (PE) fibers respectively were tested under four-point bending. The failure mechanisms and characteristics were investigated in comparison with a shotcreted steel fiber reinforced cement. The results showed that both ECCs exhibited a unique fatigue stress-life relationship that is represented by a bilinear function on a semilogarithmic scale. The failure mechanism of ECCs involved the development of multiple cracks, and the number of cracks was higher when the fatigue stress level was higher. The difference in crack opening displacement results from their different fiber bridging characteristics. PVA fibers tended to break under fatigue, while PE fibers tended to pullout. Although PE-ECC provided more cracks at the same fatigue stress, level, PVA-ECC showed larger deformation than PE-ECC because each crack width of PE-ECC was smaller than that of PVA-ECC. The deformation is shown to be governed by the number of cracks as well as the crack width, where the fiber bridging characteristics are related to either fiber rupture or fiber pullout. ASCE.'),
  (178, 178, 'Metakaolin in the formulation of UHPC', 'Metakaolin in the formulation of UHPC', NULL),
  (179, 179, 'Crack Behavior near Reinforcing Bars in Concrete Structures', 'Crack Behavior near Reinforcing Bars in Concrete Structures', NULL),
  (180, 180, 'Evolution of impedance spectra during debonding and pullout of single steel fibers from cement', 'Evolution of impedance spectra during debonding and pullout of single steel fibers from cement', 'Impedance measurements were made during the debonding and pullout of a fully embedded, crack-bridging single steel fiber from a cement matrix. Nyquist plots gave evidence of two hulk arcs, and the \"cusp\" between them proved to be sensitive to both debonding and pullout of the embedded fiber. Physical simulations that used a steel wire in tap water were applied to interpret the debonding and pull-out results. The cusp resistance from impedance spectroscopy provided quantitative information about the extent of pullout and. at least qualitatively, correlated with the debond length before pullout. Impedance measurements on both sides of the matrix crack showed that crack deflection and debonding occurred on both sides symmetrically.'),
  (181, 181, 'Effects of Manufacturing Techniques on the Flexural Behavior of Steel Fiber-Reinforced Concrete', 'Effects of Manufacturing Techniques on the Flexural Behavior of Steel Fiber-Reinforced Concrete', NULL),
  (182, 182, 'Framework for a generalized four-stage fracture model of cement-based materials', 'Framework for a generalized four-stage fracture model of cement-based materials', 'In cement-based materials the full range from brittle to ductile fracture can be achieved by changing the material structure, the loading conditions, the specimen size and/or the boundary conditions. Considering just the material, at one side of the spectrum hardened cement paste behaves brittle, whereas at the other side, new fibre reinforced cements may behave ductile. Structural conditions affect the brittleness/ductility as well, and by simply changing the loading (uniaxial tension, uniaxial and confined compression, etc.), the specimen/structure size or by changing the boundary conditions the full range from brittle to ductile response can be observed. Basically there is no difference in behaviour between the various loading cases and the same four-stage fracture process can always be identified. The four \'universal\' stages are the linear elastic regime, the microcrack regime (before the maximum load is reached), the macrocrack regime (viz. the first, usually steep part of the softening curve), and the bridging stage. Microcracks are defined as cracks that can be arrested by elements in the material structure, whereas macrocracks can only be delayed/ arrested by means or structural measures at a larger scale than the material structure. In this paper it is tried to develop a unified view on fracture of materials belonging to this broad class, which may be seen as conceptual framework for an all encompassing fracture model for cementitious materials. 2008 Elsevier Ltd. All rights reserved.'),
  (183, 183, 'Predicting the Response of Reinforced Concrete Beams Subjected to Shear Using the Modified Compression Field Theory', 'Predicting the Response of Reinforced Concrete Beams Subjected to Shear Using the Modified Compression Field Theory', NULL),
  (184, 184, 'Tensile Failure of Steel Fiber-Reinforced Mortar', 'Tensile Failure of Steel Fiber-Reinforced Mortar', NULL),
  (185, 185, 'Presentation on BCV', 'Presentation on BCV', NULL),
  (186, 186, 'Technical sheet of BCV composite concrete', 'Technical sheet of BCV composite concrete', NULL),
  (187, 187, 'Characterization of a Low-Profile Fiber-Reinforced Polymer Deck System for Moveable Bridges', 'Characterization of a Low-Profile Fiber-Reinforced Polymer Deck System for Moveable Bridges', NULL),
  (188, 188, 'A statistical tensile model of fibre reinforced cementitious composites', 'A statistical tensile model of fibre reinforced cementitious composites', NULL),
  (189, 189, 'Evaluation of Fiber Orientation in Ferromagnetic Short-Fiber Reinforced Composites by Magnetic Anisotropy', 'Evaluation of Fiber Orientation in Ferromagnetic Short-Fiber Reinforced Composites by Magnetic Anisotropy', 'Controlling preferentially oriented fibers in short-fiber reinforced composites is of great interest in determining various properties of the materials. This paper presents a new technique, the magnetic anisotropy measurement, which can effectively determine the fiber orientation in short-fiber reinforced composites. Theoretical magnetic torque curves are calculated for the composites with several different fiber distributions. The results are compared with those in prior work; the orientation descriptor obtained from the magnetic anisotropy measurement is mathematically equivalent to the well-known Hermans\' orientation parameter.'),
  (190, 190, 'TOMOGRAPHY ANALYSIS OF FIBER DISTRIBUTION AND ORIENTATION IN ULTRA HIGH PERFORMANCE FIBER-REINFORCED COMPOSITES WITH HIGH-FIBER DOSAGES', 'TOMOGRAPHY ANALYSIS OF FIBER DISTRIBUTION AND ORIENTATION IN ULTRA HIGH????Â¡Â¥??aâ‚¬???aâ‚¬???Â¨Â¦a??a??Â¨Â¦????Â¡Â¥??Â¨Â¦a??????aâ‚¬?????Â¨Â¦????Â¡Â¥??aâ‚¬???aâ‚¬?????Â¨Â¦????Â¡Â¥????Â¨Â¦????Â¨Â¦??Â¨Â¦a??????????aâ‚¬|????????Â¡Â¥??Â¨Â¦a??????aâ‚¬?????????Â¡Â¥??aâ‚¬???aâ‚¬?????Â¨Â¦????Â¡Â¥????Â¨Â¦????Â¨Â¦??Â¨Â¦aâ‚¬?????-????aâ‚¬?????????Â¡Â¥??Â¨Â¦a???|????Â¨Â¦??Â¨Â¦aâ‚¬?????-aâ‚¬?PERFORMANCE FIBER-REINFORCED COMPOSITES WITH HIGH-FIBER DOSAGES', ''),
  (192, 192, 'Fiber-Bridging constitutive law of Engineered cementitious composites', 'Fiber-Bridging constitutive law of Engineered cementitious composites', NULL),
  (193, 193, 'Strengthening and toughening mechanisms in microfiber reinforced cementitious composites', 'Strengthening and toughening mechanisms in microfiber reinforced cementitious composites', 'Materials with quasi-brittle stress strain curves exhibit desirable properties such as enhanced durability, flaw tolerance and toughness. This study reveals that steel microfiber reinforced cement based composites exhibit such quasi-brittle behavior. Mechanical properties of steel microfiber reinforced cement based composites are obtained through flexure and splitting tension tests. The cracking process and crack fiber interactions that lead to the quasi-brittle behavior in these composites were investigated. The strength and toughness enhancement is associated with crack wake mechanisms. Aggregate bridging and pullout and secondary crack formations associated with microfiber bridging sites are predominant during the strain hardening regime. Multiple secondary microcracks perpendicular to the fiber/matrix interface is the dominant failure mode beyond peak load in the strain softening regime.'),
  (194, 194, 'Spatial Distribution of Aligned Short Fibers in Cement Composites', 'Spatial Distribution of Aligned Short Fibers in Cement Composites', NULL),
  (195, 195, 'Fatigue behavior of steel fiber reinforced concrete in uniaxial and biaxial compression', 'Fatigue behavior of steel fiber reinforced concrete in uniaxial and biaxial compression', NULL),
  (196, 196, 'Cement-based materials', 'Cement-based materials', 'Key advances toward a detailed understanding and modelling of the structure and properties of cement-based materials have been made in the past year. Significant topics that have been covered are the following: self-desiccation during curing; transport properties and modelling of transport processes; sulfate attack, including delayed ettringite formation; and the structure of calcium silicate hydrate. 1998 Current Chemistry Ltd ISSN 1359-0286.'),
  (197, 197, 'Effect of inclination angle on fiber rupture load in fiber reinforced cementitious composites', 'Effect of inclination angle on fiber rupture load in fiber reinforced cementitious composites', 'A model has been formulated for analyzing the influence of fiber inclination angle on its rupture load in fiber reinforced cementitious composite. As a stiff fiber is pulled with an angle to the direction of pulling, the fiber rupture load decreases compared to the case with zero inclination angles. This phenomenon is called fiber apparent strength (defined as rupture load divided by fiber cross-section area) degradation. A parametric study, including the influence of elastic moduli of fiber and matrix, fiber/matrix interfacial bond strength as well as fiber orientation in matrix on the fiber apparent strength is carried out. The model results indicate that with the increase of fiber inclination angle, fiber apparent strength decreases. In addition, fiber apparent strength degradation degree is influenced by the elastic moduli of fiber and matrix and fiber/matrix interfacial bond strength. A fiber rupture test of carbon fiber in cementitious matrix was used for model verification. Model predictions based on independent parametric input compare favorably with experimental measurements of fiber apparent strength. 2002 Elsevier Science Ltd. All rights reserved.'),
  (198, 198, 'Experimental study on crack bridging in FRC under uniaxial fatigue tension', 'Experimental study on crack bridging in FRC under uniaxial fatigue tension', NULL),
  (199, 199, 'Vehicle-Induced Dynamic Performance of FRP versus Concrete Slab Bridge', 'Vehicle-Induced Dynamic Performance of FRP versus Concrete Slab Bridge', NULL),
  (200, 200, 'Fiber-reinforced concrete: An overview after 30 years of development', 'Fiber-reinforced concrete: An overview after 30 years of development', 'This paper presents a rhetorical discussion on the subject of fiber-reinforced concrete, FRC. It is intended as an overview of the types of commercially available FRCs and how they work. It discusses commonly applied terminology and models of mechanical behavior that form a basis for understanding material performance without presenting mathematical details. Historical review is intended to help build a background for what is currently understood about FRC rather than as historical reporting. References from both early and contemporary authors are included as a means of tying the subject together along a time line. 1997 Elsevier Science Ltd.'),
  (201, 201, 'Characterization of Interfacial Properties in Fiber-Reinforced Cementitious Composites', 'Characterization of Interfacial Properties in Fiber-Reinforced Cementitious Composites', 'For calculating interface properties from pullout tests, a simple theoretical model is proposed. The model enables calculating of the following material parameters: the parameter of shear stiffness of the fiber2013matrix boundary layer, the shear bond strength, the frictional bond strength and the specific interfacial fracture energy. These parameters can be determined from the slope of the load-slip curve, the maximum pullout load and the corresponding slip value. Slip-controlled, multiple-fiber pullout tests were conducted in a closed-loop test system. The effects of embedment length of fibers on the model-predicted material parameters were examined. The model predictions were satisfactorily compared with some previously published test data.'),
  (202, 202, 'Splice strength of conventional and high relative rib area bars in normal and high-strength concrete', 'Splice strength of conventional and high relative rib area bars in normal and high-strength concrete', 'The effects of concrete strength, coarse aggregate quantity and type, and reinforcing bar geometry on splice strength are evaluated. Results for 64 splice specimens with reinforcing bars with relative rib areas (ratio of projected rib area normal to bar axis to the product of the nominal bar perimeter and the center-to-center rib spacing) ranging from 0.069 to 0.141, concrete strengths ranging from 4250 to 15,650 psi (29 to 108 MPa), and quantities of limestone and basalt coarse aggregate ranging from 1586 to 1908 lb/yd3 (941 to 1132 kg/m3) are reported. The results are combined with the ACI Committee 408 database to develop design equations for development and splice length, which are then compared with the design criteria in ACI 318-99. For splices not confined by transverse reinforcement, the 1/4 power of compressive strength f prime c best characterizes the effect of concrete strength on splice strength. f prime c3/4 characterizes the effect of concrete strength on the additional splice strength provided by transverse reinforcement. The splice strength of bars confined by transverse reinforcement increases with an increase in relative rib area and bar diameter. The use of stronger coarse aggregate results in an increase in splice strength for bars both with and without confining reinforcement. For splices confined by transverse reinforcement, the higher the quantity of coarse aggregate, the greater the contribution of transverse reinforcement to splice strength. The expressions characterizing the splice strength of reinforcing bars accurately represent the development/splice strength of bottom-cast uncoated bars as a function of member geometry, concrete strength, relative rib area, bar size, and confinement, provided by both concrete and transverse reinforcement. The new design expressions are superior to the design criteria in ACI 318-99 in terms of both safety and economy. The criteria in ACI 318-99 for developed bars and Class A splices are unconservative for No. 6 (No. 19) and smaller bars.'),
  (203, 454, NULL, NULL, NULL),
  (224, 476, 'Size effect on nominal strength of concrete structures: Multifractality of material ligaments and dimensional transition from order to disorder', 'Size effect on nominal strength of concrete structures: Multifractality of material ligaments and dimensional transition from order to disorder', NULL),
  (260, 512, 'Shear failure analysis on ultra-high performance concrete beams reinforced with high strength steel', 'Shear failure analysis on ultra-high performance concrete beams reinforced with high strength steel', NULL),
  (263, 516, 'FATIGUE BEHAVIOR OF HIGH-PERFORMANCE CONCRETE', '', 'A fatigue study was performed on two commercial high-strength concretes\r\nof 70 MPa and 95 MPa with water/cementitious material ratios of 0.28 and\r\n0.23, respectively. Specimens were cast at the construction site and cured in the\r\nlaboratory. Tests were performed under constant amplitude, and strains were measured\r\ncontinuously using strain gauges. The McCall model for fatigue life prediction\r\nwas found to be satisfactory, and safer than the usual W6hler curves. Strain evolution\r\nand stiffness degradation with the number of cycles in high-strength concrete\r\nwere found to be similar to those of normal concrete. Strain at failure under cyclic\r\nloading was found to be of the same order as the strain at peak load under static\r\nloading. Interesting correlations between strain rate and number of cycles to failure\r\nand between stiffness decrease rate and number of cycles to failure were found.\r\nEvolution of the hysteresis loop was studied. Energy dissipated was found to decrease\r\nafter the first cycles, and increased steadily thereafter up to failure. Finally,\r\nthe differences in deformation characteristics between the two high-strength concretes\r\nstudied in this investigation were analyzed.'),
  (264, 517, 'Failure Mechanism of Concrete under Fatigue Compressive Load', '', 'In this paper, the behavior of concrete under static and fatigue compressive load is studied. Cylindrical specimens were\r\nsubjected to static cyclic and constant amplitude fatigue loading. The static cyclic tests were performed by unloading and reloading the\r\nspecimen at three different points in the postpeak period of the static loading response. Low cycle, high amplitude fatigue tests were\r\nperformed to failure using three load amplitudes. It is found that under the term of structural compliance the static compressive response\r\nof concrete can be used as an envelope for the fatigue failure compressive response. The change rate of stiffness or compliance under\r\nfatigue loading follows a two-stage process: a deceleration stage followed by an acceleration stage up to failure. The failure mechanisms\r\nfor both static and fatigue loading are explained by the band damage zone model and found to be consistent in the term of an inelastic\r\ndisplacement. The results agree well with the previous research work.'),
  (265, 518, 'Stress-Strain Relationship of Frost-Damaged Concrete Subjected to Fatigue Loading', '', 'This study attempted to develop a model for the stress-strain relationship in compression of frost-damaged concrete subjected to fatigue loading. Concrete specimens were prepared and exposed to freeze-thaw cycles followed by application of static and fatigue loading. The strains induced during the freeze-thaw test were carefully measured as well as during a mechanical loading test. It was found that the static strength and the fatigue life of concrete decreases as increasing irreversible tensile strain was induced by frost action. A stress-strain model for frost-damaged concrete under application of static and fatigue loading based on the degradation of initial stiffness caused by frost damage was presented. The degradation of initial stiffness for damaged concrete was empirically formulated as a function of remaining expansion caused by freeze-thaw cycles. The plastic strain under the application of mechanical static and fatigue loading for frost-damaged concrete is higher than that for original concrete. Therefore, plastic strain for damaged concrete was formulated as not only the function of strain level under mechanical loading, but also the function of irreversible strain caused by frost action. The unloading and reloading stiffness factors were introduced to explain the change of stiffness as increasing the number of loading cycles by considering the effect of the degree of frost damage.\r\n\r\n\r\nRead More: http://ascelibrary.org/doi/ref/10.1061/%28ASCE%290899-1561%282008%2920%3A1%2837%29'),
  (266, 519, 'Shear-Flexure Coupling Behavior of Steel Fiber-Reinforced Concrete Beams', '', 'In this study, shear-flexure coupling behavior of steel fiberreinforced\r\nconcrete (SFRC) beams was investigated. As part of the\r\nexperimental study, 12 SFRC beams were tested under low-to-high\r\nshear-to-moment ratios and with different quantities of steel fibers\r\nand longitudinal reinforcement. Both normal- and high-strength\r\nconcrete with steel fibers were evaluated. The test results were then\r\nused to validate the nonlinear modeling techniques developed for\r\nconsidering shear-flexure coupling effects in SFRC beams. Three\r\ndifferent cases of transverse normal stress or strain profiles in the\r\nbeam shear span were employed in the analytical model, depending\r\non the presence and extent of yielding of the longitudinal steel bars.\r\nThe shear-flexure interaction model reproduced the degradation\r\nassociated with the shear behavior and ductility quite accurately.'),
  (267, 520, 'Strength Prediction of Squat Structural Walls via Calibration of a Shear-Flexure Interaction Model', '', 'This study deals with a modeling approach that integrates shear and flexure interaction to predict the response\r\nof reinforced concrete squat walls. The model incorporates RC panel behavior into a displacementbased\r\ncolumn model by prescribing the average horizontal strain, at different wall heights, which is calibrated\r\nusing a 2D finite element formulation model (2D-FEM) that incorporated identical RC panel behavior.\r\nExperimental evidence shows relatively good correlation of the maximum and distribution over\r\nthe wall height of the average horizontal strain prediction, with drift variation. The model shear strength\r\nwas also compared to a database of 252 specimens, resulting in an average ratio of the predicted over the\r\nexperimental shear strength .Vmodel=Vexp/ of 1.13 for all the cases, with a coefficient of variation of 0.25,\r\nindicating a reasonably good correlation with the tests results. A sensitivity study indicates that the model\r\nstrength prediction ratio, that is, the model over the experimental strength value, is almost nil sensitive\r\nto the vertical and horizontal web reinforcement strength ratio, as well as the longitudinal boundary reinforcement\r\nstrength ratio, cross-sectional shape (rectangular or enlarged section), boundary condition\r\n(cantilever or fixed-end condition) and the axial load level supporting the reliability of the model.'),
  (268, 521, 'Behaviour of hybrid FRP-UHPC beams in flexure under fatigue loading', '', 'The fatigue behaviour of innovative hybrid FRP??Â¨Â¦a??aâ‚¬?UHPC beams under flexural loading is investigated in this\r\npaper. The beams were made up of a pultruded GFRP hollow box section beam with a cast-in-place UHPC\r\nlayer on top and either a CFRP or SFRP sheet bonded along the bottom. Four hybrid beams were tested\r\nunder variable amplitude loading, to determine the effect of cyclic loading on flexural strength and stiffness.\r\nAnalysis also included the development of a modified S??Â¨Â¦a??aâ‚¬?N curve and evaluation of fatigue damage\r\nusing the Palmgren??Â¨Â¦a??aâ‚¬?Miner rule. It was found that insignificant loss in strength and stiffness occurred for\r\nall beams, where the fatigue damage estimated using the Palmgren??Â¨Â¦a??aâ‚¬?Miner rule overestimated the fatigue\r\nlife. It was postulated, by comparison, that the hybrid beams reinforced with CFRP sheets may perform\r\nbetter under fatigue loading than the beams reinforced with SFRP sheets.'),
  (269, 522, 'Behaviour of hybrid FRP-UHPC beams subjected to static flexural loading', '', 'This paper provides the experimental results of a new hybrid beam intended for use in bridge applications.\r\nThe hybrid beams were made up of pultruded Glass Fibre Reinforced Polymer (GFRP) hollow box\r\nsection beams strengthened with a layer of Ultra-High-Performance-Concrete (UHPC) on top and either\r\na sheet of Carbon FRP (CFRP) or Steel FRP (SFRP) on the bottom of the beam. Four hybrid FRP??Â¨Â¦a??aâ‚¬?UHPC\r\nbeams were tested along with one control GFRP hollow box beam under four-point static flexural loading.\r\nTwo types of beams were tested (Phase I and Phase II), which incorporated different connection mechanisms\r\nat the GFRP??Â¨Â¦a??aâ‚¬?UHPC interface. It was concluded that the hybrid beams had higher flexural strength\r\nand stiffness than the control beam, where the beams reinforced with SFRP showed greater percent cost\r\neffectiveness than beams reinforced with CFRP. In addition, the improved connection mechanism used in\r\nPhase II beams was found to provide adequate interface bond strength to maintain full composite action\r\nuntil ultimate failure.'),
  (270, 523, 'Blast-resistant characteristics of ultra-high strength concrete and reactive powder concrete', '', 'Recent advances in nanotechnology research have been applied to improve the durability, serviceability, and safety of ultra-high performance concrete (UHPC). Furthermore, improvements in the compressive strength of concrete have allowed concrete structural member size and self-weight to be significantly reduced, which has in turn resulted in cost reduction and structural aesthetic enhancement. Among many UHPCs currently available on the market, the most representative ones are ultra-high strength concrete (UHSC) and reactive powder concrete (RPC). Even though UHSC and RPC have compressive strengths of over 100 MPa, their safety has been questioned due to possible ultra-brittle failure behavior and unfavorable cost-to-performance efficiency. The blast-resistant capacities of UHSC and RPC were experimentally evaluated to determine the possibility of using UHSC and RPC in concrete structures susceptible to terrorist attacks or accidental impacts. Slump flow, compressive strength, split tensile strength, elastic modulus, and flexure strength tests were carried out. In addition, ANFO blast tests were performed on reinforced UHSC and RPC panels. Incidental and reflected pressures, as well as maximum and residual displacements and the strains of rebar and concrete were measured. Blast damage and failure modes of the reinforced panel specimens were recorded. Our results showed that UHSC and RPC have better blast explosion resistance than normal strength concrete. The study results are discussed in detail.'),
  (272, 524, 'Experimental test methods to determine the uniaxial tensile and compressive behaviour of ultra high performance fibre reinforced concrete (UHPFRC)', '', ''),
  (274, 526, 'Size effect on flexural behavior of ultra-high-performance hybrid fiber-reinforced concrete', '', 'The size effect on the flexural behavior of ultra-high-performance hybrid fiber-reinforced concrete (UHP-HFRC) was investigated. Three different sizes of specimens were tested using four-point bending in a three-dimensional scale: 50 ??aâ‚¬?Â¡Ã€ 50 ??aâ‚¬?Â¡Ã€ 150 mm3 (small), 100 ??aâ‚¬?Â¡Ã€ 100 ??aâ‚¬?Â¡Ã€ 300 mm3 (medium), and 150 ??aâ‚¬?Â¡Ã€ 150 ??aâ‚¬?Â¡Ã€ 450 mm3 (large). For each size, two UHP-HFRCs with different fiber contents were tested to investigate the influence of tensile ductility on the size effect of UHP-HFRC in flexure. UHP-HFRC1 contained 1.0% twisted steel macro-fiber (T-fiber) and 0.5% short, smooth steel micro-fiber (SS-fiber) by volume, while UHP-HFRC2 contained a blend of 1.0% T-fiber and 1.0% SS-fiber. Both UHP-HFRCs demonstrated clear size effect on flexural strength, normalized deflection, and normalized energy absorption capacity. Furthermore, the flexural behavior of UHP-HFRC1, with its lower tensile ductility, was more sensitive to the size of the specimen.'),
