  (427, 530, 'Bond Strength Between Cast-in-Place Ultra-High- Performance- Concrete and Glass Fibre Reinforced Polymer Plates Using Epoxy Bonded Coarse Silica Sand', '', 'A significant amount of attention has been directed toward the use of fibre reinforced polymer\r\n(FRP) materials in structural applications, particularly as main components in hybrid structural members. As\r\na result, the need for an effective connection mechanism that can maintain full composite action at the interface\r\nbetween adjacent dissimilar materials is critical in order to achieve optimum performance of the hybrid\r\nstructural members. The objective of this experimental program was to investigate the bond performance\r\nbetween glass fibre reinforced polymer (GFRP) plates and cast-in-place Ultra-High-Performance- Concrete\r\n(UHPC) using epoxy bonded coarse silica sand aggregates at the bond interface. Both shear and tension\r\ntests were conducted using three different types of epoxy adhesives. The general effectiveness of the\r\nconnection mechanism at the bond interface as well as the relative performance of each epoxy adhesive\r\nused were investigated. Analysis showed that, of the three epoxy adhesives tested, the specimens bonded\r\nat the interface between the UHPC and GFRP plates using the moisture tolerant epoxy adhesive intended\r\nfor bonding of hardened concrete and steel performed the best.'),
  (428, 531, 'Damage constitutive of concrete under uniaxial alternate tension-compression fatigue loading based on double bounding surfaces', '', ''),
  (429, 515, 'A simplified constitutive model for dowel action across RC cracks', '', ''),
  (430, 533, 'Effect of Beam Size, Casting Method, and Support Conditions on Flexural Behavior of Ultra-High-Performance Fiber-Reinforced Concrete', '', 'The flexural behavior of fiber-reinforced concretes (FRCs) is typically\r\nevaluated through standard tests of beams under either threeor\r\nfour-point loading. Although these test methods are standardized,\r\ntest results could vary significantly depending on specimen\r\nsize, concrete casting method, and support devices used.\r\nResults from a comprehensive experimental program aimed at\r\nevaluating the influence of these test parameters on material flexural\r\nbehavior are presented. The investigation focused on ultrahigh-\r\nstrength (>150 MPa [22 ksi]) FRC, typically referred to as\r\nultra-high-performance FRC (UHP-FRC). By varying specimen\r\nsize, casting method, and support conditions to account for those\r\nnormally used by researchers in accordance with ASTM C1609/\r\nC1609M and RILEM TC 162-TDF, equivalent bending strengths\r\nas low as 10 MPa (1.4 ksi) and as high as 29 MPa (4.2 ksi) were\r\nobtained using the same UHP-FRC mixture design. The degree of\r\nrestraint developed at the supports intended to work as rollers was\r\nalso evaluated through finite element analyses. The use of a shear\r\nfriction coefficient of 0.4, which was found to be representative of\r\nthat in the “high-friction” supports used in this study, led to an\r\nincrease in bending strength of approximately 30% compared to\r\nbeams with no axial restraint. The test results also indicate that\r\na more specific recommendation on the casting method is needed\r\nwhen using highly workable FRC, given the variability in results\r\nbetween beams constructed following various casting methods.'),
  (431, 534, 'Interface Bond Characterization of Ultra-High Performance Concrete Overlays', '', 'Concrete bridge decks represent a critical component of the nation’s bridge network;\r\n3 however, these components are deteriorating at a rapid rate. This deterioration can be attributed\r\n4 to a number of factors, but winter salt application, the diffusion of chlorides to the reinforcing\r\n5 steel, and the eventual corrosion of the reinforcement is a primary culprit. Multiple protection\r\n6 solutions exist including: concrete protective systems, sealers, additional cover to the\r\n7 reinforcement, membranes, and epoxy coated reinforcement, but each of these solutions have\r\n8 shortcomings and do not completely address the problem. Ultra-high performance concrete, a\r\n9 relatively new material with exceptional strength and durability characteristics, may be a solution\r\n10 to these problems when used as a thin overlay on bridge decks.\r\n11 To evaluate UHPC for application as an overlay, an experimental study was performed to\r\n12 evaluate the bond strength between a UHPC overlay and a normal concrete substrate with\r\n13 different types of surface textures including, smooth, low roughness, and high roughness. Slant\r\n14 shear (ASTM C 882-05) and splitting prism (modified ASTM C 496) tests were performed to\r\n15 quantify the bond strength under combined compression and shear, and indirect tension. Test\r\n16 results demonstrated that under compressive loading (slant shear test), the bond strength is\r\n17 greater than the strength of the substrate, provided that a surface texture greater than the standard\r\n18 smooth finished mortar surface is used. For the bond strength under indirect tension (splitting\r\n19 prism test), results were not highly sensitive to the surface roughness. In both the cases, the\r\n20 measured bond strengths fall within the ranges specified in the ACI Guide for the Selection of\r\n21 Materials for the Repair of Concrete.'),
  (432, 535, 'Structural Behavior of Waffle Bridge Deck Panels and Connections of Precast Ultra-High-Performance Concrete', '', 'The AASHTO strategic plan in 2005 identified extending the service\r\nlife of bridges and accelerating bridge construction as two of the grand\r\nchallenges in bridge engineering. Previous studies have shown that\r\nusing a prefabricated full-depth precast concrete deck system not only\r\naccelerated the bridge deck rehabilitation process but also extended\r\nits service life with reduced user delays and lower life-cycle costs. The\r\nrecent use of ultra-high-performance concrete (UHPC) in the United\r\nStates for bridge applications has proved efficient and economical because\r\nof its superior structural and durability characteristics. On the basis of\r\nthe advantages of UHPC and precast systems, a design for a full-depth\r\nUHPC waffle deck panel system was developed. A full-scale, single-span,\r\n60-ft long by 33-ft wide prototype bridge with full-depth prefabricated\r\nUHPC waffle deck panels has been planned as a replacement bridge in\r\nWapello County, Iowa. In support of this project, structural performance\r\nand constructability of the UHPC waffle deck system and its critical\r\nconnections were studied through an experimental program at Iowa\r\nState University. Two prefabricated, full-depth, UHPC waffle deck\r\npanels were connected to two 24-ft long precast prestressed girders,\r\nand the system was tested under service, fatigue, and ultimate loads.\r\nOn the basis of the test observations and results and the experience\r\ngained from fabrication of deck panels and casting of UHPC infill joints\r\n(transverse and longitudinal), the prefabricated UHPC waffle deck\r\nsystem concept was found to be a viable option to achieve the goals of\r\nthe AASHTO strategic plan.');

