VALUES (28, 'journal', 'donna_2011', NULL, 1, 1, 'sdfsadfsdf', '2012-11-13 13:45:12', '2012-11-13 15:22:06'),
  (29, 'journal', 'donna_2011', NULL, 1, 3, 'True', '2012-11-13 13:45:12', '2012-11-13 15:22:06'),
