  (31, 'journal', 'donna_2011', NULL, 1, 4, '3333', '2012-11-13 13:45:12', '2012-11-13 15:22:06'),
  (32, 'journal', '22063', NULL, 1, 1, 'asdfasdf', '2012-11-13 13:46:40', '2012-11-13 13:46:40'),
  (33, 'journal', '22063', NULL, 1, 3, 'True', '2012-11-13 13:46:40', '2012-11-13 13:46:40'),
  (34, 'journal', '22063', NULL, 1, 2, '{u\'1\': True, u\'2\': False}', '2012-11-13 13:46:40', '2012-11-13 13:46:40'),
  (35, 'journal', '22063', NULL, 1, 4, '22222222', '2012-11-13 13:46:40', '2012-11-13 13:46:40'),
  (36, 'journal', '24006', NULL, 1, 15, 'The fatigue property of material is very important for its application in civil structures because most of the structures will suffer some kind of cyclic loading during their design life time. However, the existence of the fatigue limit for UHPC is under discussion.', '2012-11-14 08:46:20', '2012-11-14 09:08:34'),
  (37, 'journal', '24006', NULL, 1, 6, '', '2012-11-14 08:46:20', '2012-11-14 09:08:34'),
