  (41, 'journal', '24006', NULL, 1, 9, '{u\'1\': False, u\'3\': False, u\'2\': False, u\'4\': False}', '2012-11-14 08:46:21', '2012-11-14 09:08:34'),
  (42, 'journal', '24006', NULL, 1, 12, '{u\'1\': False, u\'3\': False, u\'2\': False, u\'5\': False, u\'4\': False}', '2012-11-14 08:46:21', '2012-11-14 09:08:34'),
  (43, 'journal', '24006', NULL, 1, 11, '{u\'1\': False, u\'3\': False, u\'2\': False, u\'5\': False, u\'4\': False}', '2012-11-14 08:46:21', '2012-11-14 09:08:34'),
  (44, 'journal', '24006', NULL, 1, 14, '{u\'1\': False, u\'3\': False, u\'2\': False, u\'4\': False}', '2012-11-14 08:46:21', '2012-11-14 09:08:34'),
  (45, 'journal', '24006', NULL, 1, 13, '', '2012-11-14 08:46:21', '2012-11-14 09:08:34'),
  (46, 'conference', '08_s2_5', NULL, 1, 15, 'Birol, Roland and Konrad [08-s2-5] did a series of uniaxial tension compression reversal fatigue test on ultra-high performance concrete using bone-shape specimens under loading frequency at 8-10 Hz. The addition of steel fibers was the key parameters investigated as all specimens went through 48 hours 90 degree C heat treatment. The tensile load varies from 20% to 80% of the tensile strength and 10% to 50% of the ultimate compressive strength. Dependent on the stress combination, the cycle number varies from thousands to millions. Traditional three phases S-N curve were applicable to represent the test results although the second phase range is enlarged if fiber exists in the concrete. The existence of fiber also changed the fracture type from brittle to ductile.', '2012-11-14 08:49:12', '2012-11-14 08:49:12'),
  (47, 'conference', '08_s2_5', NULL, 1, 6, '', '2012-11-14 08:49:12', '2012-11-14 08:49:12'),
