  (54, 'conference', '08_s2_5', NULL, 1, 14, '{u\'1\': False, u\'3\': False, u\'2\': False, u\'4\': False}', '2012-11-14 08:49:12', '2012-11-14 08:49:12'),
  (55, 'conference', '08_s2_5', NULL, 1, 13, '', '2012-11-14 08:49:12', '2012-11-14 08:49:12'),
  (56, 'journal', '24007', NULL, 1, 15, 'The uniaxial tensile fatigue behavior of was investigated by Zhang using the prisms with notches on both side. The main purpose is to quantify the crack bridging degradation along with the fatigue cycles. The straight smooth and hooked-end steel fibers were used in the test specimens. The load was controlled by deflection to ensure the minimum and maximum mouse opening for each cycle. The specimen was load first to crack. The bridging effects of fiber degrade with the increasing of load cycles and this effect could be divided into two stages depending on the degrading rate. A fast degradation was observed for the first few cycles followed by a decelerated stage until reach stable.', '2012-11-14 08:54:28', '2012-11-14 08:54:28'),
  (57, 'journal', '24007', NULL, 1, 6, '', '2012-11-14 08:54:28', '2012-11-14 08:54:28'),
