  (65, 'journal', '24007', NULL, 1, 13, '', '2012-11-14 08:54:28', '2012-11-14 08:54:28'),
  (66, 'journal', '24002', NULL, 1, 15, 'A series flexural fatigue load on Ductal were performed, and shown the material properties recommended to use for design by French code is on the safe side. The specimens were loaded up to 90% of the first crack strength for 106 cycles, after 1 million cycles, no sign of degradations. No description of reversal loading was found.(not complete, as the full text is not reachable)', '2012-11-14 08:57:23', '2012-11-14 08:57:23'),
  (67, 'journal', '24002', NULL, 1, 6, '', '2012-11-14 08:57:23', '2012-11-14 08:57:23'),
