  (75, 'journal', '24002', NULL, 1, 13, '', '2012-11-14 08:57:23', '2012-11-14 08:57:23'),
  (76, 'journal', '24001', NULL, 1, 15, 'Quasi-static flexural strength fatigue test on notched beam were performed under third point bending. It was found that fiber number across the section is not the only factor govern the flexural fatigue behavior. Regarding the fatigue crack growth, two distinct stages were found, in the first stage, the rate of crack opening is decelerated while the second stage, it is accelerated. As the deflection under fatigue loading is much larger than that for static loading, the failure criterion based on deflection is not suitable.', '2012-11-14 09:00:20', '2012-11-14 09:00:20'),
  (77, 'journal', '24001', NULL, 1, 6, '', '2012-11-14 09:00:20', '2012-11-14 09:00:20'),
