  (85, 'journal', '24001', NULL, 1, 13, 'Loading from: sinusoidal waveform at frequency of 2Hz Load control \nLoading range: 5% to 74%,83%,89%,94% of ultimate capacity Data recording: four complete cycles when the stiffness change exceed certain threshold. (stiffness calculate between high and low load)', '2012-11-14 09:00:20', '2012-11-14 09:00:20'),
  (86, 'journal', '24003', NULL, 1, 15, 'Usually the fatigue test result of conventional fiber reinforced concrete could be interpolated using linear line in S-N curve, while fatigue test done by [24003] on HPFRCC(ECC) shown bilinear relationship should be used for strain hardening material in S-N curve. And crack opening and deflection increase with the increasing of the up load level, which is the inverse for the normal FRC.', '2012-11-14 09:05:45', '2012-11-14 09:05:52'),
