  (96, 'journal', '51003', NULL, 1, 15, 'Load control between two limits fatigue tests on specimen 360x90x35mm and at 10%-85% of the ultimate load, all 8 specimens did no show sign of failure, thus 80%-85% treat as the fatigue limit.Fatigue tests on specimen 100*100*500mm had more scatters and it was concluded that the distribution of fibers within the matrix of the beam is a very important parameter affecting the fatigue life of the tested specimens.', '2012-11-14 09:07:29', '2012-11-14 09:07:29'),
