  (109, 'conference', 'UHPC12_4_1', NULL, 1, 26, 'The specimens used in the direct tension test is a regular block with cross section as 2 in. by 2 in. and total 17 in. long. Compared to the dog bone specimen usually used in this kind of test, the new type specimen is easy to cast. The aluminum side plate was glued to the specimens by the epoxy to create the grip region for testing on commonly see wedge clamps.', '2012-11-14 09:26:36', '2012-11-14 09:29:16'),
  (110, 'conference', 'UHPC12_4_1', NULL, 1, 25, '{u\'1\': True, u\'3\': True, u\'2\': False, u\'5\': False, u\'4\': False, u\'7\': False, u\'6\': False}', '2012-11-14 09:26:36', '2012-11-14 09:29:16'),
  (111, 'conference', 'UHPC12_4_1', NULL, 1, 28, '', '2012-11-14 09:26:36', '2012-11-14 09:29:16'),
  (112, 'conference', 'UHPC12_4_1', NULL, 1, 27, '', '2012-11-14 09:26:36', '2012-11-14 09:29:16'),
  (113, 'conference', 'UHPC12_4_1', NULL, 1, 29, 'Graybeal did both direct tension test and four-point bending test on unnotched specimens. The strain at the mid-portion of the specimens were collected by the surface mounted LVDTs. The moment versus mid-span strain curve was converted to the stress versus strain curve via the modified inverse analysis procedure. This curve was then compared to the stress and strain curve obtained from the direct tension test.  These two curves match with each other with slight different on ultimate strain capacities due to the size effect.', '2012-11-14 09:26:36', '2012-11-14 09:29:16'),
  (114, 'conference', 'UHPC12_4_2', NULL, 1, 5, '', '2012-11-14 09:29:01', '2012-11-14 09:29:01'),
  (115, 'conference', 'UHPC12_4_2', NULL, 1, 24, '', '2012-11-14 09:29:01', '2012-11-14 09:29:01'),
