  (118, 'conference', 'UHPC12_4_2', NULL, 1, 25, '{u\'1\': False, u\'3\': False, u\'2\': False, u\'5\': False, u\'4\': False, u\'7\': False, u\'6\': True}', '2012-11-14 09:29:01', '2012-11-14 09:29:01'),
  (119, 'conference', 'UHPC12_4_2', NULL, 1, 28, '', '2012-11-14 09:29:01', '2012-11-14 09:29:01'),
