  (121, 'conference', 'UHPC12_4_2', NULL, 1, 29, 'Also found the shear failure mode is usually coupled with the flexural failure, and fiber played an important role, both dosage wise and distribution wise.', '2012-11-14 09:29:01', '2012-11-14 09:29:01'),
